return {[-2]={id=-2,camp={1},name="测试",dType=0,monsterProduct=-2},[100]={id=100,name="世界boss",desc="世界boss",dType=0,starRequest={3,2,1},fightType=3,monsterProduct=100,populace=30,leaderName="乔瓦尼·梅塞",leaderLevel=30,leaderIcon=1,leaderScore=1600,score1=3000,score2=3000,score3=300},[200]={id=200,name="制霸沙场",desc="竞技场",dType=0,starRequest={3,2,2},fightType=3,monsterProduct=101,leaderName="威廉·尼米兹",leaderLevel=15,leaderIcon=2,leaderScore=640,score1=1500,score2=2000,score3=0},[10101]={id=10101,camp={1.0},name="追击纳粹",desc="指挥官日志：前方战报令人惊喜，爱因斯坦的时空机器协助我们扭转了这场战争，现在是对敌人发动进攻的好机会。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,next={10102.0},level=1,chapter=101,drop_show={{10411,1,1,10000},{24001,1,1,10000}},coin=200,heroExp=0,dialogs={{1,10201}},monsterProduct=10101,populace=30,card=114001,leaderName="格拉齐亚尼",leaderLevel=1,leaderIcon=3,leaderScore=60,score1=100,score2=1000,score3=0,isBoss=0},[10102]={id=10102,camp={1.0},name="陆空一体化",desc="指挥官日志：不要放松警惕指挥官，敌人在疯狂反扑，有情报显示敌人将动用空中力量对我方的地面部队进行压制。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10101.0},next={10103.0},level=1,chapter=101,drop_show={{10211,1,1,10000},{22009,1,1,10000}},coin=220,heroExp=0,dialogs={{1,10202}},monsterProduct=10102,populace=30,card=111003,leaderName="伯纳德·蒙哥马利",leaderLevel=1,leaderIcon=4,leaderScore=60,score1=100,score2=1000,score3=0,Goldnum=30,isBoss=0},[10103]={id=10103,camp={1.0},name="防空履带车",desc="指挥官日志：这批投入战场的新型战车无疑是敌方空军的克星，但问题是它们总会冲入敌阵！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10102.0},next={10104.0},level=1,chapter=101,drop_show={{21003,1,1,10000}},coin=230,heroExp=0,dialogs={{1,10203}},monsterProduct=10103,populace=30,card=111005,leaderName="切斯特·尼米兹",leaderLevel=1,leaderIcon=5,leaderScore=60,score1=100,score2=1000,score3=0,isBoss=0,story_target="夺回空指部(1-4)",target_begin=10101},[10104]={id=10104,camp={1.0},name="沙漠之狐",desc="指挥官日志：纳粹的隆美尔魔术般从埃及瞬移了他的“幽灵师团”，显然是早有准备。指挥官，你必须赶紧找出对策！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10103.0},next={10105.0},level=1,chapter=101,drop_show={{10311,1,1,10000}},coin=240,heroExp=0,dialogs={{1,10204}},monsterProduct=10104,VIPLevelToDungeon=1,populace=30,card=112001,leaderName="勒布",leaderLevel=2,leaderIcon=6,leaderScore=80,score1=200,score2=1000,score3=0,isBoss=0},[10105]={id=10105,camp={1.0},name="摧毁基地",desc="指挥官日志：根据时空精英部队给的情报，希特勒此刻正藏身于火线数公里外的一个军事基地中，自大的他肯定不能猜到我们是怎样获取情报的。指挥官，你的任务——摧毁基地！让希特勒无所遁形！",dType=1,starRequest={3,2,1},fightType=1,dTimes=-1,vit=10,pre={10104.0},next={10106.0},level=1,chapter=101,drop_show={{10111,1,1,10000}},coin=250,heroExp=0,dialogs={{1,10205}},monsterProduct=10105,populace=30,card=112005,leaderName="切斯特·尼米兹",leaderLevel=2,leaderIcon=8,leaderScore=80,score1=200,score2=1000,score3=0,isBoss=0},[10106]={id=10106,camp={1.0},name="末路元首",desc="指挥官日志：能在大战中获得和时空精英部队合作行动的机会实在是少有的荣誉，只是任务目标及报告暂时还不能解密。",dType=1,starRequest={3,2,1},fightType=6,dTimes=-1,vit=10,pre={10105.0},next={10201.0},level=1,chapter=101,drop_show={{10111,1,1,10000}},coin=260,heroExp=0,dialogs={{1,10206}},monsterProduct=10106,populace=30,card=113003,leaderName="埃尔温·隆美尔",leaderLevel=3,leaderIcon=8,leaderScore=110,score1=300,score2=1000,score3=0,Goldnum=30,isBoss=1,story_target="追击希特勒(1-6)",target_begin=10104},[10201]={id=10201,camp={1.0},name="幕后黑手",desc="指挥官日志：冷战开始了，没有硝烟，疯狂的军备竞赛在美苏两大阵营间展开。相信我，作为一个军人，我从未见过那样的武器，但我还来不及感叹军队科学家的疯狂，一份绝密情报，让我发现这背后的不妥。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10106.0},next={10202.0},level=3,chapter=102,drop_show={{10412,1,1,10000},{24005,1,1,10000}},coin=410,heroExp=0,dialogs={{1,10401},{1,10402},{1,10403},{1,0404}},monsterProduct=10201,populace=30,card=111009,leaderName="左权",leaderLevel=6,leaderIcon=5,leaderScore=200,score1=600,score2=1000,score3=0,isBoss=0},[10202]={id=10202,camp={1.0},name="纳粹残余",desc="指挥官日志：现在有理由相信纳粹忠诚的党卫军军团贼心不死在密谋着什么，可恨的是盟军、苏军竟然都与纳粹残党进行战争科技交易，现在我大概明白了那些黑科技的来源了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10201.0},next={10203.0},level=3,chapter=102,drop_show={{24007,1,1,10000}},coin=420,heroExp=0,monsterProduct=10202,populace=30,card=112009,leaderName="艾尔温·隆美尔",leaderLevel=6,leaderIcon=6,leaderScore=200,score1=600,score2=1000,score3=0,isBoss=0},[10203]={id=10203,camp={1.0},name="天启坦克",desc="指挥官日志：海德拉是什么鬼？截获的情报显示这个组织绝非党卫军那样单纯。战争永未结束，至少于我是的，盟军指挥部让我带着这只战后残破不堪的装甲突击旅，去调查情报中海德拉藏身地点——波兰南部瓦乌布日赫山区。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10202.0},next={10204.0},level=3,chapter=102,drop_show={{10212,1,1,10000},{23003,1,1,10000}},coin=430,monsterProduct=10203,populace=30,card=113004,leaderName="左权",leaderLevel=7,leaderIcon=8,leaderScore=230,score1=700,score2=1000,score3=0,isBoss=0,story_target="拦截逃亡间谍(2-3)",target_begin=10201},[10204]={id=10204,camp={1.0},name="无名战火",desc="指挥官日志：一早便预料到了这场袭击，多亏了总部调来两架冷冻直升机支援，损失得以降到最小。该死的威力巨大的怪物——它应该叫做“天启”？另我感到不安的是：在苏占区边线发生了多起小规模冲突，终于联盟和苏军要打起来了？难道他们还没打够？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10203.0},next={10205.0},level=3,chapter=102,drop_show={{22005,1,1,10000}},coin=440,monsterProduct=10204,populace=30,card=111003,leaderName="克卢格",leaderLevel=7,leaderIcon=8,leaderScore=230,score1=700,score2=1000,score3=0,isBoss=0},[10205]={id=10205,camp={1.0},name="孤军深入",desc="指挥官日志：若联盟和苏军正式开战的话，后果不堪设想，上级驳回了我的增援报告，看来已无暇关照我们了。我真心希望对海德拉的调查能够找到缓解矛盾的线索，毕竟这两头卖科技卖情报的该死的掮客，能够是什么好东西？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10204.0},next={10206.0},level=3,chapter=102,drop_show={{22001,1,1,10000}},coin=450,monsterProduct=10205,populace=30,card=111005,leaderName="乔治·巴顿",leaderLevel=8,leaderIcon=9,leaderScore=270,score1=800,score2=1000,score3=0,Goldnum=30,isBoss=0},[10206]={id=10206,camp={1.0},name="莫名的命令",desc="指挥官日志：撤退？我带领一干兄弟孤军深入，埋骨他乡，连海德拉的眉毛都没摸到就让我撤退？战争的皮条客还有保护伞吗？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10205.0},next={10207.0},level=3,chapter=102,drop_show={{10312,1,1,10000},{24006,1,1,10000}},coin=460,monsterProduct=10206,populace=30,card=112001,leaderName="格拉齐亚尼",leaderLevel=8,leaderIcon=10,leaderScore=270,score1=800,score2=1000,score3=0,isBoss=1,story_target="摧毁入侵图拉防线的装甲（2-6）"},[10207]={id=10207,camp={1.0},name="九头蛇组织",desc="指挥官日志：最后一晚，这是我们最接近海德拉秘密基地的一晚，天亮就按该死的命令撤退。时间不多了，今晚总得查出点什么来。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={10206.0},next={10208.0},level=3,chapter=102,drop_show={{21007,1,1,10000}},coin=470,monsterProduct=10207,talk={{0,"哈哈哈，我的飞碟能让接近它们的机械单位失灵，变成废物",1,4}},hero_show=61004,populace=30,card=112003,leaderName="奥马尔·布莱德雷",leaderLevel=9,leaderIcon=10,leaderScore=310,score1=900,score2=1000,score3=0,isBoss=0},[10208]={id=10208,camp={1.0},name="九头蛇首领",desc="指挥官日志：猛烈的袭击，部队已所剩无几，但敌人目标已暴露，九头蛇的秘密基地已在眼前。如果有人让我此刻撤退，那下命令的人一定是在叛国！这次袭击将是我人生最大的一次冒险，但比起爆发世界大战，这又算得了什么呢？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10207.0},next={10301.0},level=3,chapter=102,drop_show={{10112,1,1,10000},{21002,1,1,10000}},coin=480,monsterProduct=10208,populace=30,card=111009,leaderName="奥马尔·布莱德雷",leaderLevel=9,leaderIcon=10,leaderScore=310,score1=900,score2=1000,score3=0,isBoss=1,story_target="莫斯科郊外的晚上（2-8）"},[10301]={id=10301,camp={1.0},name="坦克杀手",desc="指挥官日志：一个月！九头蛇首领,噢，不，应该还是纳粹的新领袖狂傲的挑战就换来美苏间一个月的纸上和平？！更多的证据！海德拉，我会追杀你到天涯海角！",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={10208.0},next={10302.0},level=8,chapter=103,drop_show={{10413,1,1,10000},{24002,1,1,10000}},coin=610,dialogs={{1,10601},{1,10602},{1,10603},{1,10604},{1,10605},{1,10606},{2,11701}},monsterProduct=10301,populace=30,card=111008,leaderName="伯纳德·蒙哥马利",leaderLevel=11,leaderIcon=10,leaderScore=450,score1=1100,score2=2000,score3=0,isBoss=0},[10302]={id=10302,camp={1.0},name="遥远的桥",desc="指挥官日志：克莱斯勒公司二千万战争债券提供的战车工厂总算是保下来了，接下来该派这些新机器去干活了。乱上加乱——纳粹复燃了，居然竟然还有少部分盟军叛军，短时间搞不明白是怎么一回事。他们占据了莱茵河对面雷马根区块，“攻下那座桥”，指挥部的命令只有这五个字。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10301.0},next={10303.0},level=8,chapter=103,drop_show={{24003,1,1,10000}},coin=620,monsterProduct=10302,populace=30,card=112007,leaderName="奥马尔·布莱德雷",leaderLevel=12,leaderIcon=10,leaderScore=490,score1=1200,score2=2000,score3=0,isBoss=0},[10303]={id=10303,camp={1.0},name="武装直升机I",desc="指挥官日志：战斗很激烈，但战领者是我们，再攻过去，叛乱区就要被平定了。很难相信有那么多平民陪葬——当他们着魔似的手里拿着铁器利器朝你涌来，根本没有选择余地。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10302.0},next={10304.0},level=8,chapter=103,drop_show={{23005,1,1,100}},coin=630,monsterProduct=10303,populace=30,card=114001,leaderName="伯纳德·蒙哥马利",leaderLevel=13,leaderIcon=10,leaderScore=540,score1=1300,score2=2000,score3=0,isBoss=0,story_target="摧毁防空盖特坦克营（3-3）"},[10304]={id=10304,camp={1.0},name="命令与将军",desc="指挥官日志：敌人哪来数量如此多的武装直升机？躲进战壕！然后？坚守阵地。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10303.0},next={10305.0},level=8,chapter=103,drop_show={{10213,1,1,10000},{23006,1,1,10000}},coin=640,monsterProduct=10304,populace=30,card=112001,leaderName="格拉齐亚尼",leaderLevel=14,leaderIcon=10,leaderScore=590,score1=1400,score2=2000,score3=0,isBoss=0},[10305]={id=10305,camp={1.0},name="入侵者战机I",desc="指挥官日志：入侵者战机，那是苏军的装备，是苏军利用九头蛇打击我们，还是苏军被九头蛇控制利用，我不得而知。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10304.0},next={10306.0},level=8,chapter=103,drop_show={{23004,1,1,100}},coin=650,monsterProduct=10305,populace=30,card=111003,leaderName="乔瓦尼·梅塞",leaderLevel=15,leaderIcon=10,leaderScore=640,score1=1500,score2=2000,score3=0,Goldnum=10,isBoss=0},[10306]={id=10306,camp={1.0},name="矛与盾",desc="指挥官日志：天呐，当我看到这些天启坦克的时候，我已绝望地在做最后祷告，岂知道天无绝人之路，这些天启坦克却是苏军派来支援我们的——一起恍然大悟，苏军盟军再次联合起来，九头蛇胆敢犯众，看来死期不远了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10305.0},next={10307.0},level=8,chapter=103,drop_show={{23001,1,1,100}},coin=660,monsterProduct=10306,populace=30,card=111005,leaderName="奥马尔·布莱德雷",leaderLevel=16,leaderIcon=10,leaderScore=690,score1=1600,score2=2000,score3=0,isBoss=0},[10307]={id=10307,camp={1.0},name="203高地",desc="指挥官日志：九头蛇突然停止了接连不断的空袭，战壕里士兵都快发疯了，黄昏时有个年轻的小伙违抗命令爬出战壕，不幸的是冷枪夺走他的生命。他为何爬出去，没有人知道为什么。可是，今天的前线战报我还能怎么写呢？——西线无战事。仅此。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10306.0},next={10308.0},level=8,chapter=103,drop_show={{22002,1,1,100}},coin=670,monsterProduct=10307,populace=30,card=113005,leaderName="德怀特·艾森豪威尔",leaderLevel=17,leaderIcon=10,leaderScore=740,score1=1700,score2=2000,score3=0,isBoss=0},[10308]={id=10308,camp={1.0},name="拯救大兵",desc="指挥官日志：我一个情同手足的部下——温特斯少校，被敌人围困。大局上，自顾不暇，应该放弃这只连队，但是这次我还是偏私了。温斯特不能就这样死去。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10307.0},next={10309.0},level=8,chapter=103,drop_show={{10313,1,1,10000},{21001,1,1,10000}},coin=680,monsterProduct=10308,populace=30,card=111008,leaderName="乔治·巴顿",leaderLevel=18,leaderIcon=10,leaderScore=790,score1=1800,score2=2000,score3=0,isBoss=1,story_target="消灭日本舰队的空军（3-8）"},[10309]={id=10309,camp={1.0},name="伏龙芝军校I",desc="指挥官日志：那是不同的光景在伏龙芝军校——你很少见到在军校里会因派系斗争而经常有小规模灭口事件发生。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10308.0},next={10310.0},level=8,chapter=103,drop_show={{22004,1,1,100}},coin=690,monsterProduct=10309,populace=30,card=112007,leaderName="勃劳希契",leaderLevel=19,leaderIcon=10,leaderScore=840,score1=1900,score2=2000,score3=0,isBoss=0},[10310]={id=10310,camp={1.0},name="伏龙芝军校II",desc="指挥官日志：伏龙芝军校有一种红色恐怖的压抑。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10309.0},next={10311.0},level=8,chapter=103,drop_show={{21009,1,1,100}},coin=700,monsterProduct=10310,populace=30,card=114001,leaderName="切斯特·尼米兹",leaderLevel=20,leaderIcon=10,leaderScore=900,score1=2000,score2=2000,score3=0,Goldnum=10,isBoss=0},[10311]={id=10311,camp={1.0},name="突围路线",desc="指挥官日志：如同以往，我将突围。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10310.0},next={10312.0},level=8,chapter=103,drop_show={{21005,1,1,100}},coin=710,monsterProduct=10311,populace=30,card=112001,leaderName="切斯特·尼米兹",leaderLevel=20,leaderIcon=10,leaderScore=900,score1=2000,score2=2000,score3=0,isBoss=0},[10312]={id=10312,camp={1.0},name="兵工厂",desc="指挥官日志：那是钢铁与鲜血铺就的铁路，谁都不想做倒下去的那个，但是谁都倒下了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10311.0},next={10401.0},level=8,chapter=103,drop_show={{10113,1,1,10000},{21008,1,1,10000}},coin=720,monsterProduct=10312,populace=30,card=111003,leaderName="道格拉斯·麦克阿瑟",leaderLevel=20,leaderIcon=10,leaderScore=900,score1=2000,score2=2000,score3=0,isBoss=1,story_target="消灭负隅顽抗的日军（3-12）"},[10313]={id=10313,camp={1.0},name="救命船只",desc="盟军简报：部队从海军工厂得到了船只，而顺波托马克河而下显然是一个不错的选择，但我们决定兵行险招，利用船只渡河，夺回空军基地。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10312.0},next={10314.0},level=8,chapter=103,coin=730,monsterProduct=10313,populace=30,card=111005,leaderName="格拉齐亚尼",leaderLevel=20,leaderIcon=10,leaderScore=900,score1=2000,score2=2000,score3=0,isBoss=0},[10314]={id=10314,camp={1.0},name="逃离",desc="盟军简报：该死，我们中了敌人的埋伏，当我们轻松夺下空军基地之时，已经有大量敌人包围了这里。幸亏支援部队的及时赶到，否则我们就埋葬在这了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10313.0},next={10315.0},level=8,chapter=103,coin=740,monsterProduct=10314,populace=30,card=113005,leaderName="伊塔洛·巴尔博",leaderLevel=20,leaderIcon=10,leaderScore=900,score1=2000,score2=2000,score3=0,isBoss=0},[10315]={id=10315,camp={1.0},name="绝望和希望",desc="盟军简报：支援部队虽然帮我们逃离了空军基地，但也身陷华盛顿的包围。当我们绝望之时，突然发现我们遗弃的船只停靠在岸边，不过有小股部队正在检查。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10314.0},next={10316.0},level=8,chapter=103,coin=750,monsterProduct=10315,populace=30,card=112005,leaderName="左权",leaderLevel=20,leaderIcon=10,leaderScore=900,score1=2000,score2=2000,score3=0,isBoss=0},[10316]={id=10316,camp={1.0},name="海军实验室",desc="盟军简报：信息显示这是海军实验室的防守小队，并得到可靠情报，那里有一艘潜艇可供我们逃离这里，这是唯一的希望。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10315.0},next={10401.0},level=8,chapter=103,coin=760,monsterProduct=10316,populace=30,card=112002,leaderName="乔治·巴顿",leaderLevel=20,leaderIcon=10,leaderScore=900,score1=2000,score2=2000,score3=0,isBoss=0},[10401]={id=10401,camp={1.0},name="入侵者战机II",desc="指挥官日志：友军的援助让我们有了空对空能力。当入侵者战机从我方上空呼啸出击，我不禁想起前几天几乎无还手之力的狼狈模样。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10312.0},next={10402.0},level=15,chapter=104,drop_show={{10414,1,1,9000},{24001,1,1,10000}},coin=810,dialogs={{1,10801},{1,10802},{1,10803},{1,10804}},monsterProduct=10401,populace=30,card=114005,leaderName="伯纳德·蒙哥马利",leaderLevel=21,leaderIcon=10,leaderScore=1010,score1=2100,score2=3000,score3=0,isBoss=0},[10402]={id=10402,camp={1.0},name="武装直升机II",desc="指挥官日志：我们也有武装直升机了，进一步加强了制空能力。部队进一步向敌军空军基地逼近。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10401.0},next={10403.0},level=15,chapter=104,drop_show={{22008,1,1,100}},coin=820,monsterProduct=10402,populace=30,card=112001,leaderName="格奥尔吉·朱可夫",leaderLevel=22,leaderIcon=10,leaderScore=1070,score1=2200,score2=3000,score3=0,isBoss=0},[10403]={id=10403,camp={1.0},name="地狱火",desc="指挥官日志：这是盟军最新防空工具——地狱火导弹，让敌方的飞行器都放马过来吧。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10402.0},next={10404.0},level=15,chapter=104,drop_show={{24004,1,1,100}},coin=830,monsterProduct=10403,populace=30,card=113003,leaderName="伊塔洛·巴尔博",leaderLevel=23,leaderIcon=10,leaderScore=1130,score1=2300,score2=3000,score3=0,isBoss=0},[10404]={id=10404,camp={1.0},name="爆破手研究室",desc="指挥官日志：为何在之前打德军的时候有意放过这个规模庞大战争飞行器研究室？现在它是九头蛇的研究室了。我想明白了那些入侵者和武装直升飞机哪里来的了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10403.0},next={10405.0},level=15,chapter=104,drop_show={{10214,1,1,9000},{23002,1,1,10000}},coin=840,monsterProduct=10404,populace=30,card=113005,leaderName="切斯特·尼米兹",leaderLevel=24,leaderIcon=10,leaderScore=1190,score1=2400,score2=3000,score3=0,isBoss=0},[10405]={id=10405,camp={1.0},name="UFO？",desc="指挥官日志：这个爆破手研究室远远没有它看上去的那么简单，调查人员发现了精密且庞大的设计图纸碎片，初步判断那只是一个部件——那会是什么啊？此外，圆形的飞行器？不是传说中的UFO么？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10404.0},next={10406.0},level=15,chapter=104,drop_show={{22005,1,1,100}},coin=850,monsterProduct=10405,populace=30,card=111003,leaderName="切斯特·尼米兹",leaderLevel=25,leaderIcon=10,leaderScore=1250,score1=2500,score2=3000,score3=0,isBoss=0,story_target="掠夺德军的后勤矿车（4-5）"},[10406]={id=10406,camp={1.0},name="黑色轰炸机",desc="指挥官日志：捷报，我们地位显然从无人在乎上升到战争核心了，不确定的消息据说近期将得到盟军的最新飞行科技的支援。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10405.0},next={10407.0},level=15,chapter=104,drop_show={{22009,1,1,100}},coin=860,monsterProduct=10406,populace=30,card=111005,leaderName="奥马尔·布莱德雷",leaderLevel=26,leaderIcon=10,leaderScore=1310,score1=2600,score2=3000,score3=0,Goldnum=10,isBoss=0},[10407]={id=10407,camp={1.0},name="等待黑鹰",desc="指挥官日志：没有黑鹰战斗机我们无法攻下这里——未曾预料到九头蛇的空指部竟然比过去的德军要强大得多。黑鹰来前只能守了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10406.0},next={10408.0},level=15,chapter=104,drop_show={{22003,1,1,100}},coin=870,monsterProduct=10407,populace=30,card=112001,leaderName="乔治·巴顿",leaderLevel=27,leaderIcon=10,leaderScore=1380,score1=2700,score2=3000,score3=100,isBoss=0},[10408]={id=10408,camp={1.0},name="铁血长空",desc="指挥官日志：时候到了——攻下敌军的空指挥部！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10407.0},next={10409.0},level=15,chapter=104,drop_show={{10314,1,1,9000},{22007,1,1,10000}},coin=880,monsterProduct=10408,populace=30,card=111003,leaderName="伯纳德·蒙哥马利",leaderLevel=28,leaderIcon=10,leaderScore=1460,score1=2800,score2=3000,score3=200,isBoss=1,story_target="突破德军时空部队的封锁（4-8）"},[10409]={id=10409,camp={1.0},name="西点军校I",desc="指挥官日志：你知道这场战争美国佬为何这么好事么？你知道西点军校里全是些有钱没处花的暴发户你就知道答案了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10408.0},next={10410.0},level=15,chapter=104,drop_show={{21003,1,1,100}},coin=890,monsterProduct=10409,populace=30,card=111005,leaderName="博克",leaderLevel=29,leaderIcon=10,leaderScore=1520,score1=2900,score2=3000,score3=200,isBoss=0},[10410]={id=10410,camp={1.0},name="西点军校II",desc="指挥官日志：当新港的暴发户不受旧绅士待见，就会用战争话题去堵死世袭传统的嘴。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10409.0},next={10411.0},level=15,chapter=104,drop_show={{21006,1,1,100}},coin=900,monsterProduct=10410,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=30,leaderIcon=10,leaderScore=1600,score1=3000,score2=3000,score3=300,Goldnum=20,isBoss=0},[10411]={id=10411,camp={1.0},name="迟到的敌军",desc="指挥官日志：我们感慨敌军空军部队华丽的同时，不免想若不是他们的坦克战车掉了链子。结局也许不同。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10410.0},next={10412.0},level=15,chapter=104,drop_show={{22006,1,1,100}},coin=910,monsterProduct=10411,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=30,leaderIcon=10,leaderScore=1600,score1=3000,score2=3000,score3=300,isBoss=0},[10412]={id=10412,camp={1.0},name="华丽一英里",desc="指挥官日志：这是胜利的时间，可以见到头顶上的敌军空军如同枪打麻雀一样纷纷落下。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10411.0},next={10501.0},level=15,chapter=104,drop_show={{10114,1,1,9000},{21010,1,1,10000}},coin=920,monsterProduct=10412,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=30,leaderIcon=10,leaderScore=1600,score1=3000,score2=3000,score3=300,isBoss=1,story_target="保卫斯大林格勒（4-12）"},[10413]={id=10413,camp={1.0},name="苏军舰队",desc="盟军简报：穿过华丽一英里，我们就能看到树立在那的巨大的心灵信标。但是支援而来的苏军舰队显然让我们陷入了一定的麻烦之中。利用海军摧毁他。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10412.0},next={10414.0},level=15,chapter=104,coin=930,monsterProduct=10413,populace=30,card=114005,leaderName="埃尔温·隆美尔",leaderLevel=30,leaderIcon=10,leaderScore=1600,score1=3000,score2=3000,score3=300,isBoss=0},[10414]={id=10414,camp={1.0},name="陆军部队",desc="盟军简报：敌人已经越来越多，陆军部队显然也已经结合到了此处，看来是准备决一死战了。摆好阵型，击溃他们。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10413.0},next={10415.0},level=15,chapter=104,coin=940,monsterProduct=10414,populace=30,card=112001,leaderName="埃尔温·隆美尔",leaderLevel=30,leaderIcon=10,leaderScore=1600,score1=3000,score2=3000,score3=300,isBoss=0},[10415]={id=10415,camp={1.0},name="合纵连横",desc="盟军简报：残留部队竟然组成了一个连横的火力网，看来是要进行困兽之斗了，加把力击溃他们。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10414.0},next={10416.0},level=15,chapter=104,coin=950,monsterProduct=10415,populace=30,card=113003,leaderName="左权",leaderLevel=30,leaderIcon=10,leaderScore=1600,score1=3000,score2=3000,score3=300,isBoss=0},[10416]={id=10416,camp={1.0},name="心灵信标",desc="盟军简报：守在心灵信标前的敌人已经全部被歼灭。但是这心灵信标后面竟然还有埋伏着一波敌人，当我们准备破坏心灵信标之时，突然杀出，让我们措手不及。心灵信标快要发动了，迅速击溃敌人，摧毁心灵信标。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10415.0},next={10501.0},level=15,chapter=104,coin=960,monsterProduct=10416,populace=30,card=113005,leaderName="勃洛姆堡",leaderLevel=30,leaderIcon=10,leaderScore=1600,score1=3000,score2=3000,score3=300,isBoss=0},[10501]={id=10501,camp={1.0},name="法国巨炮",desc="指挥官日志：每个人一开始都远远低估了九头蛇的实力，很难想象，隐藏在党卫军旗下如此之深的组织，其实力深不可测，甚至超越原来的纳粹。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10412.0},next={10502.0},level=20,chapter=105,drop_show={{10415,1,1,8000},{24005,1,1,10000}},coin=1010,dialogs={{1,10901},{1,10902},{1,10903},{1,10904}},monsterProduct=10501,populace=30,card=112010,leaderName="勃洛姆堡",leaderLevel=31,leaderIcon=10,leaderScore=1730,score1=3100,score2=4000,score3=400,isBoss=0},[10502]={id=10502,camp={1.0},name="男爵",desc="指挥官日志：该死的巨炮让我的主战坦克都成了炮灰，攻下前方的敌军技术部队，我们必须得掌握更多的信息。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10501.0},next={10503.0},level=20,chapter=105,drop_show={{24007,1,1,100}},coin=1020,monsterProduct=10502,populace=30,card=113006,leaderName="伯纳德·蒙哥马利",leaderLevel=32,leaderIcon=10,leaderScore=1800,score1=3200,score2=4000,score3=400,isBoss=0},[10503]={id=10503,camp={1.0},name="盖特坦克",desc="指挥官日志：这个男爵可真不是省油的灯，兼职就是杀戮机械天才，我有不好的预感。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10502.0},next={10504.0},level=20,chapter=105,drop_show={{23003,1,1,100}},coin=1030,monsterProduct=10503,populace=30,card=112003,leaderName="克卢格",leaderLevel=33,leaderIcon=10,leaderScore=1880,score1=3300,score2=4000,score3=500,isBoss=0},[10504]={id=10504,camp={1.0},name="男爵的实验",desc="指挥官日志：离九头蛇男爵的实验室不远了，真想亲自手刃了这个疯子。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10503.0},next={10505.0},level=20,chapter=105,drop_show={{10215,1,1,8000},{23006,1,1,10000}},coin=1040,monsterProduct=10504,populace=30,card=112007,leaderName="道格拉斯·麦克阿瑟",leaderLevel=34,leaderIcon=10,leaderScore=1960,score1=3400,score2=4000,score3=600,Goldnum=10,isBoss=0,story_target="切断沙漠之狐军团补给（5-4）"},[10505]={id=10505,camp={1.0},name="V3火箭",desc="指挥官日志：可恶！实验室被友军炸成了碎片，那些不可告人的秘密就此灰飞烟灭，男爵逃脱了，他还会再来的。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10504.0},next={10506.0},level=20,chapter=105,drop_show={{23007,1,1,100}},coin=1050,monsterProduct=10505,populace=30,card=112005,leaderName="道格拉斯·麦克阿瑟",leaderLevel=35,leaderIcon=10,leaderScore=2030,score1=3500,score2=4000,score3=600,isBoss=0},[10506]={id=10506,camp={1.0},name="火箭车弱点",desc="指挥官日志：不想赶紧想办法对付这灵活的远程移动导弹装甲部队，我们就只有葬身火海的份！可你知道这大发战争财的商人——克莱斯勒集团竟然送来了采矿车？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10505.0},next={10507.0},level=20,chapter=105,drop_show={{22010,1,1,100}},coin=1060,monsterProduct=10506,populace=30,card=113005,leaderName="乔瓦尼·梅塞",leaderLevel=36,leaderIcon=10,leaderScore=2110,score1=3600,score2=4000,score3=700,isBoss=0},[10507]={id=10507,camp={1.0},name="海德拉再现",desc="指挥官日志：哈哈，没想到这个装了机炮的矿车，简直就是高速移动的装甲，对付V3小口径机炮让它自爆便可。又一次胜利！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10506.0},next={10508.0},level=20,chapter=105,drop_show={{22001,1,1,100}},coin=1070,monsterProduct=10507,populace=30,card=114005,leaderName="切斯特·尼米兹",leaderLevel=37,leaderIcon=10,leaderScore=2190,score1=3700,score2=4000,score3=800,Goldnum=20,isBoss=0},[10508]={id=10508,camp={1.0},name="机器人大师",desc="指挥官日志：海德拉首领这个带面具的狂人怕是被惹毛了，再一次口出狂言。不过我还是谨慎点为好。对于这个深不可测的对手我们唯一可以确定的就是他是在纳粹党卫队中成长起来的，死去的希特勒一定知道是怎么回事。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10507.0},next={10509.0},level=20,chapter=105,drop_show={{10315,1,1,8000},{22008,1,1,10000}},coin=1080,monsterProduct=10508,populace=30,card=112010,leaderName="格奥尔吉·朱可夫",leaderLevel=38,leaderIcon=10,leaderScore=2260,score1=3800,score2=4000,score3=800,isBoss=1,story_target="击溃隆美尔的王牌天启（5-8）"},[10509]={id=10509,camp={1.0},name="高堡奇人",desc="指挥官日志：人人都说躲在阿尔卑斯高耸城堡里的纳粹奇葩多的是，真是让人惊悚。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10508.0},next={10510.0},level=20,chapter=105,drop_show={{21009,1,1,100}},coin=1090,monsterProduct=10509,populace=30,card=111005,leaderName="博克",leaderLevel=39,leaderIcon=10,leaderScore=2340,score1=3900,score2=4000,score3=800,isBoss=0},[10510]={id=10510,camp={1.0},name="推进速度",desc="指挥官日志：男爵部队的弱点很明显——没有兼具装甲与火力的强力主战坦克，V3火箭再厉害，推进速度快它也难以瞄准。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10509.0},next={10511.0},level=20,chapter=105,drop_show={{21011,1,1,100}},coin=1100,monsterProduct=10510,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=40,leaderIcon=10,leaderScore=2410,score1=4000,score2=4000,score3=800,Goldnum=20,isBoss=0},[10511]={id=10511,camp={1.0},name="冷冻V3巨炮",desc="指挥官日志：这个熟悉的搭配印象中我在军校里倒是熟悉过。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10510.0},next={10512.0},level=20,chapter=105,drop_show={{21011,1,1,100}},coin=1110,monsterProduct=10511,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=41,leaderIcon=10,leaderScore=2480,score1=4100,score2=4000,score3=800,isBoss=0},[10512]={id=10512,camp={1.0},name="炮击范围",desc="指挥官日志：什么！我们的基地处于巨炮的射程内？这可不是什么好消息。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={10511.0},next={10601.0},level=20,chapter=105,drop_show={{10115,1,1,8000},{21002,1,1,10000}},coin=1120,monsterProduct=10512,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=42,leaderIcon=10,leaderScore=2560,score1=4200,score2=4000,score3=800,isBoss=1,story_target="将德意联军逐出非洲（5-12）"},[10513]={id=10513,camp={1.0},name="双管齐下2",desc="盟军简报：栋别湖，海军进攻什切青的重要据点之一，有着大量的敌军在此，我们需要歼灭他们，才能让海军的顺利进军。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10512.0},next={10514.0},level=20,chapter=105,coin=1130,monsterProduct=10513,populace=30,card=113005,leaderName="博克",leaderLevel=40,leaderIcon=10,leaderScore=2430,score1=4000,score2=4000,score3=1000,isBoss=0},[10514]={id=10514,camp={1.0},name="别拉瓦镇",desc="盟军简报：别拉瓦镇，什切青重要的水道交通要地，占领他就等于控制住了什切青全部水道的交通，但是敌人显然也知道，有着重兵驻扎此地。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10513.0},next={10515.0},level=20,chapter=105,coin=1140,monsterProduct=10514,populace=30,card=114005,leaderName="乔治·巴顿",leaderLevel=40,leaderIcon=10,leaderScore=2430,score1=4000,score2=4000,score3=1000,isBoss=0},[10515]={id=10515,camp={1.0},name="合围之势",desc="盟军简报：我们已经查询到发射井的具体位置所在，离的越近，受到的抵抗也也强烈。但我们必须完成对给地区的合围。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10514.0},next={10516.0},level=20,chapter=105,coin=1150,monsterProduct=10515,populace=30,card=111003,leaderName="勃洛姆堡",leaderLevel=40,leaderIcon=10,leaderScore=2430,score1=4000,score2=4000,score3=1000,isBoss=0},[10516]={id=10516,camp={1.0},name="最后的顺利",desc="盟军简报：核发射井已经就在眼前，我们必须加快进攻脚步以确保他们不能把核弹发射出去。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10515.0},next={10601.0},level=20,chapter=105,coin=1160,monsterProduct=10516,populace=30,card=111005,leaderName="凯特尔",leaderLevel=40,leaderIcon=10,leaderScore=2430,score1=4000,score2=4000,score3=1000,isBoss=0},[10601]={id=10601,camp={1.0},name="海德拉基地",desc="指挥官日志：九头蛇的强大依托于其难以想象的科技，之前我们摧毁了他的飞行器研究基地、战车研究基地，眼下这座研究基地已经是第三座黑科技中心了，目前还没有资料显示该研究室从事工作属何领域。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10508.0},next={10602.0},level=30,chapter=106,drop_show={{10416,1,1,7500},{24002,1,1,10000}},coin=1210,dialogs={{1,11001},{1,11002},{2,11101}},monsterProduct=10601,populace=30,card=114002,leaderName="勃洛姆堡",leaderLevel=41,leaderIcon=10,leaderScore=2560,score1=4100,score2=5000,score3=1000,isBoss=0},[10602]={id=10602,camp={1.0},name="超级士兵",desc="指挥官日志：我唯一确定的一点就是对面那些士兵不再是人类。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10601.0},next={10603.0},level=30,chapter=106,drop_show={{24003,1,1,100}},coin=1220,monsterProduct=10602,populace=30,card=111007,leaderName="博克",leaderLevel=42,leaderIcon=10,leaderScore=2650,score1=4200,score2=5000,score3=1100,isBoss=0},[10603]={id=10603,camp={1.0},name="武装采矿车",desc="指挥官日志：这个实验室拥有我见过最庞大的能源支撑系统，炸弹矿石厂群应该能让它罢工。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10602.0},next={10604.0},level=30,chapter=106,drop_show={{23005,1,1,100}},coin=1230,monsterProduct=10603,populace=30,card=114001,leaderName="德怀特·艾森豪威尔",leaderLevel=43,leaderIcon=10,leaderScore=2730,score1=4300,score2=5000,score3=1200,isBoss=0},[10604]={id=10604,camp={1.0},name="两个希特勒",desc="指挥官日志：昨日有探子回报见到了不可能发生的事情——他见到希特勒这个魔鬼复活了，在这个秘密基地附近现身。这是怎么一回事？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10603.0},next={10605.0},level=30,chapter=106,drop_show={{10216,1,1,7500},{23004,1,1,10000}},coin=1240,monsterProduct=10604,populace=30,card=111003,leaderName="勃劳希契",leaderLevel=44,leaderIcon=10,leaderScore=2810,score1=4400,score2=5000,score3=1200,Goldnum=10,isBoss=0,story_target="登陆西西里岛（6-4）"},[10605]={id=10605,camp={1.0},name="自爆卡车",desc="指挥官日志：两个，不还可能有更多的希特勒，当然这都比不上只有一个，呃，重点应该在九头蛇竟然有能力复制人！我军必须全力推进阻止这邪恶计划！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10604.0},next={10606.0},level=30,chapter=106,drop_show={{23001,1,1,100}},coin=1250,monsterProduct=10605,populace=30,card=111005,leaderName="博克",leaderLevel=45,leaderIcon=10,leaderScore=2900,score1=4500,score2=5000,score3=1300,isBoss=0},[10606]={id=10606,camp={1.0},name="抵挡自爆",desc="指挥官日志：这是最后一波了——我们能抵抗的最后一波，除此之外再无良策，兄弟们，让我们在另一边再会！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10605.0},next={10607.0},level=30,chapter=106,drop_show={{22002,1,1,100}},coin=1260,monsterProduct=10606,populace=30,card=112005,leaderName="博克",leaderLevel=46,leaderIcon=10,leaderScore=2990,score1=4600,score2=5000,score3=1400,isBoss=0},[10607]={id=10607,camp={1.0},name="战斗要塞",desc="指挥官日志：我们没想过能活下来，也不指望战局会突然有转机，我知道那家伙一定还有很多底牌，但剩下的士兵早已不再留恋于曾经那段短暂胜利与和平，这是场新的持久战，已至僵局，谁若不这样想，他魂已随硝烟散去。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={10606.0},next={10608.0},level=30,chapter=106,drop_show={{22006,1,1,100}},coin=1270,monsterProduct=10607,populace=30,card=112010,leaderName="切斯特·尼米兹",leaderLevel=47,leaderIcon=10,leaderScore=3070,score1=4700,score2=5000,score3=1400,Goldnum=20,isBoss=0},[10608]={id=10608,camp={1.0},name="嘿，姑娘",desc="指挥官日志：听说男爵这次是受了九头蛇军令要跟我们决一死战来着？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10607.0},next={10609.0},level=30,chapter=106,drop_show={{10316,1,1,7500},{22004,1,1,10000}},coin=1280,monsterProduct=10608,populace=30,card=113004,leaderName="左权",leaderLevel=48,leaderIcon=10,leaderScore=3160,score1=4800,score2=5000,score3=1500,isBoss=1,story_target="击溃奥廖尔纳粹守军（6-8）"},[10609]={id=10609,camp={1.0},name="谍中谍",desc="指挥官日志：敌军的间谍一旦侵入我方阵地，敌军的单位将变得相当可怕！对了，我养的狗呢？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10608.0},next={10610.0},level=30,chapter=106,drop_show={{21004,1,1,100}},coin=1290,monsterProduct=10609,populace=30,card=111005,leaderName="博克",leaderLevel=49,leaderIcon=10,leaderScore=3240,score1=4900,score2=5000,score3=1500,isBoss=0},[10610]={id=10610,camp={1.0},name="核弹废料",desc="指挥官日志：对面的敌人请听着：“自爆袭击没用，真没用！”",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10609.0},next={10611.0},level=30,chapter=106,drop_show={{21005,1,1,100}},coin=1300,monsterProduct=10610,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=50,leaderIcon=10,leaderScore=3320,score1=5000,score2=5000,score3=1500,Goldnum=20,isBoss=0},[10611]={id=10611,camp={1.0},name="恐怖机器人",desc="指挥官日志：很明显战局胜负已定，没几只像样的主战坦克，敌人的战术就剩下旁门左道了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10610.0},next={10612.0},level=30,chapter=106,drop_show={{21008,1,1,100}},coin=1310,monsterProduct=10611,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=51,leaderIcon=10,leaderScore=3400,score1=5100,score2=5000,score3=1500,isBoss=0},[10612]={id=10612,camp={1.0},name="爬虫与偷袭",desc="指挥官日志：前方的爬虫是障眼法，注意保留实力，以应付敌人的偷袭。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={10611.0},next={10701.0},level=30,chapter=106,drop_show={{10116,1,1,7500}},coin=1320,monsterProduct=10612,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=52,leaderIcon=10,leaderScore=3480,score1=5200,score2=5000,score3=1500,isBoss=1,story_target="在哈尔科夫全歼敌军（6-12）"},[10613]={id=10613,camp={1.0},name="阿灵顿敌袭",desc="盟军简报：阿灵顿地区的部队发来急电，该地区有着一个军事基地，正出兵来袭击我们后方，我们要做好被冲击的准备。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10612.0},next={10614.0},level=30,chapter=106,coin=1330,monsterProduct=10613,populace=30,card=111005,leaderName="小乔治·巴顿",leaderLevel=50,leaderIcon=10,leaderScore=3330,score1=5000,score2=5000,score3=1600,isBoss=0},[10614]={id=10614,camp={1.0},name="收复阿灵顿",desc="盟军简报：想不到不是什么战略要地的阿灵顿居然隐藏着如此大的军事基地，为了避免背腹受敌，先解决这个军事基地。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10613.0},next={10615.0},level=30,chapter=106,coin=1340,monsterProduct=10614,populace=30,card=112005,leaderName="德怀特·艾森豪威尔",leaderLevel=50,leaderIcon=10,leaderScore=3330,score1=5000,score2=5000,score3=1600,isBoss=0},[10615]={id=10615,camp={1.0},name="围歼",desc="盟军简报：我们在华盛顿接二连三的进攻，敌人显然要招架不住了。有敌人已经要跑路了。建立好包围圈，别让敌人跑了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10614.0},next={10616.0},level=30,chapter=106,coin=1350,monsterProduct=10615,populace=30,card=112010,leaderName="奥马尔·布莱德雷",leaderLevel=50,leaderIcon=10,leaderScore=3330,score1=5000,score2=5000,score3=1600,isBoss=0},[10616]={id=10616,camp={1.0},name="五角大楼",desc="盟军简报：所有的区域都已经被收复，现在就剩下这个五角大楼了，为了荣耀，攻下他。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10615.0},next={10701.0},level=30,chapter=106,coin=1360,monsterProduct=10616,populace=30,card=113004,leaderName="乔治·巴顿",leaderLevel=50,leaderIcon=10,leaderScore=3330,score1=5000,score2=5000,score3=1600,isBoss=0},[10701]={id=10701,camp={1.0},name="十面埋伏",desc="指挥官日志：在这片大陆，每一寸九头蛇污染的土地已被我们清除洗净，可红骷髅究竟在哪，还是无人可知。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10608.0},next={10702.0},level=40,chapter=107,drop_show={{10417,1,1,6500},{24001,1,1,10000}},coin=1410,dialogs={{1,11201},{1,11202},{1,11203},{1,11204}},monsterProduct=10701,populace=30,card=111001,leaderName="勃洛姆堡",leaderLevel=51,leaderIcon=10,leaderScore=3480,score1=5100,score2=6000,score3=1700,isBoss=0},[10702]={id=10702,camp={1.0},name="基洛夫空艇",desc="指挥官日志：阴云蔽日，寸土不生。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10701.0},next={10703.0},level=40,chapter=107,drop_show={{24006,1,1,100}},coin=1420,monsterProduct=10702,populace=30,card=111007,leaderName="博克",leaderLevel=52,leaderIcon=10,leaderScore=3570,score1=5200,score2=6000,score3=1800,isBoss=0},[10703]={id=10703,camp={1.0},name="空中要塞",desc="指挥官日志：喜报，情报人员似乎已掌握九头蛇首领线索，并展开行动。可悲的是，那在爆破实验室中搜查到的庞大飞行器图纸碎片——那玩意已经被造出来了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10702.0},next={10704.0},level=40,chapter=107,drop_show={{10418,1,1,5000},{24004,1,1,10000}},coin=1430,monsterProduct=10703,populace=30,card=112006,leaderName="张自忠",leaderLevel=53,leaderIcon=10,leaderScore=3650,score1=5300,score2=6000,score3=1800,isBoss=0},[10704]={id=10704,camp={1.0},name="迎接的枪声",desc="指挥官日志：我的部队已经脱离了那庞大飞船的攻击范围，不远就是盟军57师的防空阵地。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={10703.0},next={10705.0},level=40,chapter=107,drop_show={{23002,1,1,100}},coin=1440,monsterProduct=10704,populace=30,card=113003,leaderName="奥马尔·布莱德雷",leaderLevel=54,leaderIcon=10,leaderScore=3750,score1=5400,score2=6000,score3=1900,Goldnum=10,isBoss=0,story_target="中国远征军走向胜利（7-4）"},[10705]={id=10705,camp={1.0},name="激光技术",desc="指挥官日志：阵地经过叛徒的破坏已经不再牢靠了，现在唯一的出路就是主动出击，我们必须知道这怪物的弱点。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10704.0},next={10706.0},level=40,chapter=107,drop_show={{10217,1,1,6500},{22005,1,1,10000}},coin=1450,monsterProduct=10705,populace=30,card=114002,leaderName="勃劳希契",leaderLevel=55,leaderIcon=10,leaderScore=3840,score1=5500,score2=6000,score3=2000,isBoss=0},[10706]={id=10706,camp={1.0},name="内忧外患I",desc="指挥官日志：虽然已有情报描述这个长脚蜘蛛怪物的详细情况，但没想到亲眼所见还是那么难以置信——它太灵活了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10705.0},next={10707.0},level=40,chapter=107,drop_show={{22009,1,1,100}},coin=1460,monsterProduct=10706,populace=30,card=114005,leaderName="海因茨·古德里安",leaderLevel=56,leaderIcon=10,leaderScore=3920,score1=5600,score2=6000,score3=2000,isBoss=0},[10707]={id=10707,camp={1.0},name="内忧外患II",desc="指挥官日志：至今为止我对九头蛇的了解是他是一个有野心有能力的邪恶的天才将领，但是他的自负让他常常拿出一些华而不实的招数。知道这点就够了！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10706.0},next={10708.0},level=40,chapter=107,drop_show={{10218,1,1,5000},{22003,1,1,10000}},coin=1470,monsterProduct=10707,populace=30,card=111006,leaderName="克卢格",leaderLevel=57,leaderIcon=10,leaderScore=4020,score1=5700,score2=6000,score3=2100,Goldnum=20,isBoss=0},[10708]={id=10708,camp={1.0},name="从未陨落",desc="指挥官日志：恐怖机器人、遥控坦克，不过只是玩具，联军对九头蛇机械科技的掌握已经够多了，那些从未陨落的，今天就让它从未诞生。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10707.0},next={10709.0},level=40,chapter=107,drop_show={{22007,1,1,100}},coin=1480,monsterProduct=10708,populace=30,card=111003,leaderName="奥马尔·布莱德雷",leaderLevel=58,leaderIcon=10,leaderScore=4120,score1=5800,score2=6000,score3=2200,isBoss=1,story_target="营救被困英国盟军（7-8）"},[10709]={id=10709,camp={1.0},name="军事演习I",desc="指挥官日志：上头为了防止之前的狼狈状况重现，安排了两场军事演习作为考核。不通过的指挥官将被停职查看处理。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10708.0},next={10710.0},level=40,chapter=107,drop_show={{10317,1,1,6500},{21003,1,1,10000}},coin=1490,monsterProduct=10709,populace=30,card=111005,leaderName="博克",leaderLevel=59,leaderIcon=10,leaderScore=4150,score1=5900,score2=5000,score3=2200,isBoss=0},[10710]={id=10710,camp={1.0},name="军事演习II",desc="指挥官日志：联盟国各首脑将参观这次军演，上头为了华丽场面，据说在空中要塞目标里装了自毁装置，打不过就按按钮。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10709.0},next={10711.0},level=40,chapter=107,drop_show={{10318,1,1,5000},{21006,1,1,10000}},coin=1500,monsterProduct=10710,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=60,leaderIcon=10,leaderScore=4240,score1=6000,score2=5000,score3=2200,Goldnum=20,isBoss=0},[10711]={id=10711,camp={1.0},name="高堡遗孤",desc="指挥官日志：最近频频有情报说纳粹被摧毁后有一贵族遗孤被保护撤离到了九头蛇，希特勒是不育的。那会是谁呢？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10710.0},next={10712.0},level=40,chapter=107,drop_show={{10117,1,1,6500},{21007,1,1,10000}},coin=1510,monsterProduct=10711,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=61,leaderIcon=10,leaderScore=4320,score1=6100,score2=5000,score3=2200,isBoss=0},[10712]={id=10712,camp={1.0},name="侏儒心",desc="指挥官日志：那不是孩子，而是侏儒，一个长着扭曲臭脸和肥胖身材有着一样的扭曲想法的侏儒。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10711.0},next={10801.0},level=40,chapter=107,drop_show={{10118,1,1,5000},{21010,1,1,10000}},coin=1520,monsterProduct=10712,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=62,leaderIcon=10,leaderScore=4410,score1=6200,score2=5000,score3=2200,isBoss=1,story_target="消灭缅甸残余日军（7-12）"},[10713]={id=10713,camp={1.0},name="拉奈岛 ",desc="盟军简报：我军已经封锁了珍珠港，为了不让外部支援而来，我们决定先把拉奈岛强攻下来。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10712.0},next={10714.0},level=40,chapter=107,coin=1530,monsterProduct=10713,populace=30,card=114002,leaderName="切斯特·尼米兹",leaderLevel=60,leaderIcon=10,leaderScore=4300,score1=6000,score2=6000,score3=2300,isBoss=0},[10714]={id=10714,camp={1.0},name="分割战场",desc="盟军简报：敌人已经龟缩在了毛伊岛，我们需要舰队支援，从马阿来亚和卡胡卢伊进行对毛伊岛的战场分割。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10713.0},next={10715.0},level=40,chapter=107,coin=1540,monsterProduct=10714,populace=30,card=114005,leaderName="乔治·巴顿",leaderLevel=60,leaderIcon=10,leaderScore=4300,score1=6000,score2=6000,score3=2300,isBoss=0},[10715]={id=10715,camp={1.0},name="各个击破",desc="盟军简报：我军已经形成对毛伊岛的战场分割，现在把他们赶出我们的领土。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10714.0},next={10716.0},level=40,chapter=107,coin=1550,monsterProduct=10715,populace=30,card=111001,leaderName="伯纳德·蒙哥马利",leaderLevel=60,leaderIcon=10,leaderScore=4300,score1=6000,score2=6000,score3=2300,isBoss=0},[10716]={id=10716,camp={1.0},name="珍珠港之战",desc="盟军简报：珍珠港内的敌人已经没有退路，也没有支援了。全力攻击，把他们赶下海去，看看是毛熊厉害还是鲨鱼厉害。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10715.0},next={10801.0},level=40,chapter=107,coin=1560,monsterProduct=10716,populace=30,card=111005,leaderName="切斯特·尼米兹",leaderLevel=60,leaderIcon=10,leaderScore=4300,score1=6000,score2=6000,score3=2300,isBoss=0},[10801]={id=10801,camp={1.0},name="佐拉博士",desc="指挥官日志：已取得红骷髅的得力助手一个叫佐拉的疯狂博士，战争前这人是研究基因的专家，一个男爵已经够麻烦的了。随着男爵的节节退败，这家伙开始接收男爵的任务了么？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10708.0},next={10802.0},level=40,chapter=108,drop_show={{10419,1,1,4500},{24005,1,1,10000}},coin=1610,dialogs={{1,11301},{1,11302},{1,11303},{1,11304},{1,11305},{1,11306}},monsterProduct=10801,populace=30,card=111002,leaderName="德怀特·艾森豪威尔",leaderLevel=61,leaderIcon=10,leaderScore=4450,score1=6100,score2=7000,score3=2400,isBoss=0},[10802]={id=10802,camp={1.0},name="第三帝国",desc="指挥官日志：一切都伪装得天衣无缝，这可以算得上是连绵雪岭中隐藏的奇迹，突然的黑色岩石是雷达与炮塔，堡垒工事主体完全嵌入山体之中。据可靠情报，这便是红骷髅基业老巢了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10801.0},next={10803.0},level=40,chapter=108,drop_show={{24007,1,1,100}},coin=1620,monsterProduct=10802,populace=30,card=113002,leaderName="克卢格",leaderLevel=62,leaderIcon=10,leaderScore=4540,score1=6200,score2=7000,score3=2400,isBoss=0},[10803]={id=10803,camp={1.0},name="我们需要支援",desc="指挥官日志：约翰·施密特，这个魔鬼有一个不起眼的名字，他诞生在一个普通却悲剧的家庭，酗酒的父亲，家暴而死的母亲，离开孤儿院不久就犯下命案，那个红骷髅面具是希特勒晚宴上送给这个特别行动组织领导者的礼物——密报0014，此页日志于我过世方可公开。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10802.0},next={10804.0},level=40,chapter=108,drop_show={{10420,1,1,4000},{23003,1,1,10000}},coin=1630,monsterProduct=10803,populace=30,card=112006,leaderName="勃洛姆堡",leaderLevel=63,leaderIcon=10,leaderScore=4640,score1=6300,score2=7000,score3=2500,Goldnum=10,isBoss=0,story_target="抵御自杀式攻击的纳粹（8-3）"},[10804]={id=10804,camp={1.0},name="磁能坦克",desc="指挥官日志：这场攻坚战不好打，敌人也不像过往那样淡定了，那是好事。另我匪夷所思的是，军内有关于我不好的流言，事到如今，明眼人知道我军出了叛徒。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10803.0},next={10805.0},level=40,chapter=108,drop_show={{23006,1,1,100}},coin=1640,monsterProduct=10804,populace=30,card=111003,leaderName="伯纳德·蒙哥马利",leaderLevel=64,leaderIcon=10,leaderScore=4740,score1=6400,score2=7000,score3=2600,isBoss=0},[10805]={id=10805,camp={1.0},name="谁是叛徒",desc="指挥官日志：今天向总部发了密笺，平可元夫这个混蛋，如果他不马上束手递上辞呈，等不到军事法庭的审判我就要用刺刀剖开其胸膛，证据表明这个一向忠厚老实的副官面具地下是阴毒的叛徒。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10804.0},next={10806.0},level=40,chapter=108,drop_show={{10219,1,1,4500},{23007,1,1,10000}},coin=1650,monsterProduct=10805,populace=30,card=114001,leaderName="海因茨·古德里安",leaderLevel=65,leaderIcon=10,leaderScore=4830,score1=6500,score2=7000,score3=2600,isBoss=0},[10806]={id=10806,camp={1.0},name="局势逆转",desc="指挥官日志：特斯拉贡献的磁能坦克，竟然被敌人先一步派上战场，好在我方科技后勤已按照红骷髅的图纸准备了秘密武器。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10805.0},next={10807.0},level=40,chapter=108,drop_show={{22010,1,1,100}},coin=1660,monsterProduct=10806,populace=30,card=111002,leaderName="克卢格",leaderLevel=66,leaderIcon=10,leaderScore=4930,score1=6600,score2=7000,score3=2700,isBoss=0},[10807]={id=10807,camp={1.0},name="爱因斯坦",desc="指挥官日志：我不明白为何在最后关头撤派我的部队去保护重要人物，这样前面的拉锯围攻有何意义？但是听到爱因斯坦这个名字时，我让手下加快手脚整装打包。上次这个科学家出手，时空战队干掉了希特勒。不管如何，这肯定是当下最重要的事情。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10806.0},next={10808.0},level=40,chapter=108,drop_show={{10220,1,1,4000},{22001,1,1,10000}},coin=1670,monsterProduct=10807,populace=30,card=113002,leaderName="切斯特·尼米兹",leaderLevel=67,leaderIcon=10,leaderScore=5030,score1=6700,score2=7000,score3=2800,Goldnum=20,isBoss=0},[10808]={id=10808,camp={1.0},name="我灭了红骷髅",desc="指挥官日志：我看明白了敌人一定又是从内部瓦解了。边站边逃的士兵，倾巢而出的自爆卡车，自杀式攻击机器人，他们肯定知道这也结束了。令我费解的事，部队让我守住这一块命名为“登陆地”的空地。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10807.0},next={10809.0},level=40,chapter=108,drop_show={{22008,1,1,100}},coin=1680,monsterProduct=10808,populace=30,card=112006,leaderName="艾尔温·隆美尔",leaderLevel=68,leaderIcon=10,leaderScore=5130,score1=6800,score2=7000,score3=2800,isBoss=1,story_target="抢滩登陆（8-8）"},[10809]={id=10809,camp={1.0},name="虐待女俘",desc="指挥官日志：敌军俘虏了我们一批女文工团。你记得苏联提议的那个磁化巴黎铁塔来袭击敌军的提议么？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10808.0},next={10810.0},level=40,chapter=108,drop_show={{10319,1,1,4500},{21009,1,1,10000}},coin=1690,monsterProduct=10809,populace=30,card=111005,leaderName="博克",leaderLevel=69,leaderIcon=10,leaderScore=5110,score1=6900,score2=5000,score3=2800,isBoss=0},[10810]={id=10810,camp={1.0},name="超时空战俘",desc="指挥官日志：我方能够派秘密小队穿越于时空执行任务，可是敌人为何也总能知悉事情的发展？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10809.0},next={10811.0},level=40,chapter=108,drop_show={{10320,1,1,4000},{21011,1,1,10000}},coin=1700,monsterProduct=10810,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=70,leaderIcon=10,leaderScore=5200,score1=7000,score2=5000,score3=2800,isBoss=0},[10811]={id=10811,camp={1.0},name="科技烟火",desc="指挥官日志：就我个人更倾向于把各种华丽的新科技单位作战看作是烟花表演。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10810.0},next={10812.0},level=40,chapter=108,drop_show={{10119,1,1,4500},{21001,1,1,10000}},coin=1710,monsterProduct=10811,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=71,leaderIcon=10,leaderScore=5290,score1=7100,score2=5000,score3=2800,Goldnum=20,isBoss=0},[10812]={id=10812,camp={1.0},name="天启坦克",desc="指挥官日志：天启坦克是这个时代的主力。这年头你的队伍里没有天启，你都不好意思说自己是指挥官。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10811.0},next={10901.0},level=40,chapter=108,drop_show={{10120,1,1,4000},{21002,1,1,10000}},coin=1720,monsterProduct=10812,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=72,leaderIcon=10,leaderScore=5380,score1=7200,score2=5000,score3=2800,isBoss=1,story_target="会师总攻诺曼底（8-12）"},[10813]={id=10813,camp={1.0},name="意外之战",desc="盟军简报：我军在南下不远之处，便发现该地区有敌人的一个重要基地，有着层层的军队把守，攻下这个秘密据点，一定对我们有利。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10812.0},next={10814.0},level=50,chapter=108,coin=1730,monsterProduct=10813,populace=30,card=112006,leaderName="勃劳希契",leaderLevel=70,leaderIcon=10,leaderScore=5330,score1=7000,score2=7000,score3=3000,isBoss=0},[10814]={id=10814,camp={1.0},name="资源重地",desc="盟军简报：原来敌人在此处要建一个核弹发射井，幸亏我们及时赶到。有这个发射井就意味着他们还占领着一个更大的矿产重地，找到并夺回来。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10813.0},next={10815.0},level=50,chapter=108,coin=1740,monsterProduct=10814,populace=30,card=113002,leaderName="小乔治·巴顿",leaderLevel=70,leaderIcon=10,leaderScore=5330,score1=7000,score2=7000,score3=3000,isBoss=0},[10815]={id=10815,camp={1.0},name="渡河之战",desc="盟军简报：敌人虽然已经失去了重要的资源点，但还顽固的守在心灵信标之前。河岸部队，迅速渡河，已最快的速度摧毁敌人的心灵信标。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10814.0},next={10816.0},level=50,chapter=108,coin=1750,monsterProduct=10815,populace=30,card=112010,leaderName="勃洛姆堡",leaderLevel=70,leaderIcon=10,leaderScore=5330,score1=7000,score2=7000,score3=3000,isBoss=0},[10816]={id=10816,camp={1.0},name="孤注一掷",desc="盟军简报：敌人已经孤注一掷，想要通过心灵信标来对我军完成大规模的杀伤。在他发动之前摧毁他。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10815.0},next={10901.0},level=50,chapter=108,coin=1760,monsterProduct=10816,populace=30,card=111007,leaderName="张自忠",leaderLevel=70,leaderIcon=10,leaderScore=5330,score1=7000,score2=7000,score3=3000,isBoss=0},[10901]={id=10901,camp={1.0},name="狙击小组",desc="士兵日志：毫无疑问我们是最精英的，全军，甚至是全球——由苏军和盟军挑选的最精英的士兵组成。我旁边对面那位兄弟吹牛他能够在八百里外一枪爆头，我起初不信，直到我看见他对着拨通的电话开了一枪。我发誓，我这辈子再也不敢惹阿三了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10808.0},next={10902.0},level=50,chapter=109,drop_show={{10421,1,1,3500},{24002,1,1,10000}},coin=1810,dialogs={{1,11401},{1,11402},{1,11403}},monsterProduct=10901,populace=30,card=112008,leaderName="勒布",leaderLevel=71,leaderIcon=10,leaderScore=5480,score1=7100,score2=8000,score3=3000,isBoss=0},[10902]={id=10902,camp={1.0},name="C4炸弹",desc="士兵日志：虽然人人都觉得那个俄国妞高不可攀很不过瘾，但是没人敢去沾惹我家谭雅一条毫毛。你知道吗？在训练中我见到她有掏不完的C4。可以炸掉半个柏林。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10901.0},next={10903.0},level=50,chapter=109,drop_show={{24003,1,1,100}},coin=1820,monsterProduct=10902,populace=30,card=111005,leaderName="克卢格",leaderLevel=72,leaderIcon=10,leaderScore=5580,score1=7200,score2=8000,score3=3100,isBoss=0},[10903]={id=10903,camp={1.0},name="超时空军团兵",desc="士兵日志：第一次尝试这种传送装置的时候，少数人有呕吐，水泡等这样的被称做“冷冻剂”过敏的反应。直到一个叫做托马斯·拉斯基的士官在传送的时候吐满了密封服。这少数人才被开除出队伍。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10902.0},next={10904.0},level=50,chapter=109,drop_show={{10422,1,1,3000},{23005,1,1,10000}},coin=1830,monsterProduct=10903,populace=30,card=111002,leaderName="伯纳德·蒙哥马利",leaderLevel=73,leaderIcon=10,leaderScore=5690,score1=7300,score2=8000,score3=3200,Goldnum=10,isBoss=0,story_target="突破莱茵河防线（9-3）"},[10904]={id=10904,camp={1.0},name="希特勒之死",desc="士兵日志：上面说，这次不是演习。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10903.0},next={10905.0},level=50,chapter=109,drop_show={{23004,1,1,100}},coin=1840,monsterProduct=10904,populace=30,card=113002,leaderName="凯特尔",leaderLevel=74,leaderIcon=10,leaderScore=5780,score1=7400,score2=8000,score3=3200,isBoss=0},[10905]={id=10905,camp={1.0},name="终极潜入",desc="<空>",dType=1,starRequest={3,2,1},fightType=7,dTimes=-1,vit=10,pre={10904.0},next={10906.0},level=50,chapter=109,drop_show={{10221,1,1,3500},{23001,1,1,10000}},coin=1850,monsterProduct=10905,populace=30,card=112006,leaderName="切斯特·尼米兹",leaderLevel=75,leaderIcon=10,leaderScore=5890,score1=7500,score2=8000,score3=3300,isBoss=0},[10906]={id=10906,camp={1.0},name="超级英雄",desc="士兵日志：我想我是唯一一个幸存者，虽然我方很强大，有俄国大妞和谭炸炸联手，但可能是我眼花了，我看到一个带着面罩披着奇怪斗篷的人将俄国妞从楼上抛了下来。我提前启动了传回装置，希望没人再去使用它。这样就能圆谎了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10905.0},next={10907.0},level=50,chapter=109,drop_show={{22002,1,1,100}},coin=1860,monsterProduct=10906,populace=30,card=111003,leaderName="伯纳德·蒙哥马利",leaderLevel=76,leaderIcon=10,leaderScore=6000,score1=7600,score2=8000,score3=3400,isBoss=0},[10907]={id=10907,camp={1.0},name="孤注一掷",desc="士兵最后日志：好消息和坏消息——幸存者回来了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10906.0},next={10908.0},level=50,chapter=109,drop_show={{10222,1,1,3000},{22006,1,1,10000}},coin=1870,monsterProduct=10907,populace=30,card=114001,leaderName="切斯特·尼米兹",leaderLevel=77,leaderIcon=10,leaderScore=6090,score1=7700,score2=8000,score3=3400,Goldnum=20,isBoss=0},[10908]={id=10908,camp={1.0},name="意识永存",desc="<空>",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10907.0},next={10909.0},level=50,chapter=109,drop_show={{22004,1,1,100}},coin=1880,monsterProduct=10908,populace=30,card=111002,leaderName="伯纳德·蒙哥马利",leaderLevel=78,leaderIcon=10,leaderScore=6200,score1=7800,score2=8000,score3=3500,isBoss=1,story_target="地板行动与麒麟行动（9-8）"},[10909]={id=10909,camp={1.0},name="精神风暴",desc="指挥官日志：我没想过风暴从何而来。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10908.0},next={10910.0},level=50,chapter=109,drop_show={{10321,1,1,3500},{21004,1,1,10000}},coin=1890,monsterProduct=10909,populace=30,card=111005,leaderName="博克",leaderLevel=79,leaderIcon=10,leaderScore=6290,score1=7900,score2=8000,score3=3500,isBoss=0},[10910]={id=10910,camp={1.0},name="控场大师",desc="指挥官日志：我得承认敌人很有想法，很能够也仅能够控制住场面。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10909.0},next={10911.0},level=50,chapter=109,drop_show={{10322,1,1,3000},{21005,1,1,10000}},coin=1900,monsterProduct=10910,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=80,leaderIcon=10,leaderScore=6390,score1=8000,score2=8000,score3=3500,isBoss=0},[10911]={id=10911,camp={1.0},name="寸步难行",desc="指挥官日志：我感慨敌人上次不过是火力缺席而已。这次真是碰上麻烦了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10910.0},next={10912.0},level=50,chapter=109,drop_show={{10121,1,1,3500},{21008,1,1,10000}},coin=1910,monsterProduct=10911,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=81,leaderIcon=10,leaderScore=6500,score1=8100,score2=8000,score3=3600,Goldnum=20,isBoss=0},[10912]={id=10912,camp={1.0},name="皇牌空军I",desc="指挥官日志：这是被解决的英国皇储亲自披襟上阵打破了这场僵局。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10911.0},next={11001.0},level=50,chapter=109,drop_show={{10122,1,1,3000}},coin=1920,monsterProduct=10912,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=82,leaderIcon=10,leaderScore=6600,score1=8200,score2=8000,score3=3600,isBoss=1,story_target="巴顿将军的愤怒（9-12）"},[10913]={id=10913,camp={1.0},name="突袭资源点",desc="盟军简报：敌人已经进入绝境，困兽之斗对我军不利，为了减少我军伤亡，我们决定改变作战方针，围而不打，派兵突袭敌人军需处，没有补给，敌军自乱。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10912.0},next={10914.0},level=55,chapter=109,coin=1930,monsterProduct=10913,populace=30,card=111002,leaderName="伯纳德·蒙哥马利",leaderLevel=80,leaderIcon=10,leaderScore=6400,score1=8000,score2=8000,score3=3600,isBoss=0},[10914]={id=10914,camp={1.0},name="梅里达之战",desc="盟军简报：敌人已经露出疲态，乘胜追击，攻下梅里达。摧毁这里的实验室。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10913.0},next={10915.0},level=55,chapter=109,coin=1940,monsterProduct=10914,populace=30,card=114002,leaderName="小乔治·巴顿",leaderLevel=80,leaderIcon=10,leaderScore=6400,score1=8000,score2=8000,score3=3600,isBoss=0},[10915]={id=10915,camp={1.0},name="海军基地",desc="盟军简报：位于普罗格雷索的敌人海军基地，敌人已经逃到此处，一鼓作气，拿下这个基地。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10914.0},next={10916.0},level=55,chapter=109,coin=1950,monsterProduct=10915,populace=30,card=112006,leaderName="伊塔洛·巴尔博",leaderLevel=80,leaderIcon=10,leaderScore=6400,score1=8000,score2=8000,score3=3600,isBoss=0},[10916]={id=10916,camp={1.0},name="墨西哥湾",desc="盟军简报：敌人舰队已经逃至墨西哥海湾，我军已经在那埋伏多时。全力攻击，消灭敌人舰队赢的这次作战的胜利。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10915.0},next={11001.0},level=55,chapter=109,coin=1960,monsterProduct=10916,populace=30,card=113002,leaderName="勒布",leaderLevel=80,leaderIcon=10,leaderScore=6400,score1=8000,score2=8000,score3=3600,isBoss=0},[11001]={id=11001,camp={1.0},name="心灵控制",desc="指挥官日志：我没有想法。对于平可元夫我一点想法都没有。他确实是一个老实的好人，我们错误地把愤怒发泄到他身上并轰杀了他，但谁能想到那是精神操控呢？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={10908.0},next={11002.0},level=55,chapter=110,drop_show={{10423,1,1,2500},{24001,1,1,10000}},coin=2010,dialogs={{1,11501},{1,11502},{1,11503},{1,11504}},monsterProduct=11001,populace=30,card=111004,leaderName="博克",leaderLevel=81,leaderIcon=10,leaderScore=6570,score1=8100,score2=9000,score3=3700,isBoss=0},[11002]={id=11002,camp={1.0},name="基因工程",desc="指挥官日志：谭雅带领的超时空精英部队这次的穿越给出的报告是红骷髅已经被成功刺杀。鉴于之前采集的佐拉从事的基因病毒相关的研究情报，佐拉很可能成为瓦解后流窜的海德拉暂时头目，而其行动应该会以小规模恐怖袭击为主，就像一只烦人的苍蝇。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11001.0},next={11003.0},level=55,chapter=110,drop_show={{24006,1,1,100}},coin=2020,monsterProduct=11002,populace=30,card=111003,leaderName="伊塔洛·巴尔博",leaderLevel=82,leaderIcon=10,leaderScore=6680,score1=8200,score2=9000,score3=3800,isBoss=0},[11003]={id=11003,camp={1.0},name="病毒炸弹",desc="指挥官日志：红场叛徒尤里，这个苏军失控的怪物在把自己的脑袋改造成武器之后，就失去了踪影，平可元夫的悲剧大部分就是他造成的，看来疯子总是臭味相投，一只复制的尤里军队——除了高空轰炸我没想到其他解决办法。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11002.0},next={11004.0},level=55,chapter=110,drop_show={{10424,1,1,2000},{24004,1,1,10000}},coin=2030,monsterProduct=11003,populace=30,card=111005,leaderName="张自忠",leaderLevel=83,leaderIcon=10,leaderScore=6770,score1=8300,score2=9000,score3=3800,Goldnum=10,isBoss=0},[11004]={id=11004,camp={1.0},name="神经突击车",desc="指挥官日志：我们知道它会发生，但是却不知道什么时候、在哪里发生。恐怖袭击让我们的人有来自宿命的压迫感。“我还活着”信使传达的红骷髅留言真假难辨。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11003.0},next={11005.0},level=55,chapter=110,drop_show={{23002,1,1,100}},coin=2040,monsterProduct=11004,populace=30,card=112010,leaderName="道格拉斯·麦克阿瑟",leaderLevel=84,leaderIcon=10,leaderScore=6890,score1=8400,score2=9000,score3=3900,isBoss=0,story_target="盟军合围攻城（10-4）"},[11005]={id=11005,camp={1.0},name="生化专家",desc="指挥官日志：“你没有发言的权利”，今天来了几个最高安全级别的工程公职人员，我没有任何详细一点的信息甚至是名字，在我尽职盘问的时候。“我已经活了432年，我们处理内部事务轮不到秩序内阶层询问。”我想我没必要跟一个疯子计较，无奈的是他归我保护。",dType=1,starRequest={3,2,1},fightType=7,dTimes=-1,vit=10,pre={11004.0},next={11006.0},level=55,chapter=110,drop_show={{10223,1,1,2500},{22005,1,1,10000}},coin=2050,monsterProduct=11005,populace=30,card=111007,leaderName="格拉齐亚尼",leaderLevel=85,leaderIcon=10,leaderScore=7000,score1=8500,score2=9000,score3=4000,isBoss=0},[11006]={id=11006,camp={1.0},name="基地车",desc="指挥官日志：惊恐的消息：爱尔兰岛没人幸存。起初我们以为敌人的精神控制传播机制是磁场或是视觉上的信息致幻，可悲的是总部谍文写得很清楚，它是一种生存力极强的RNA反转录病毒，可以通过血液、唾液、虫媒、甚至水源等多种途径传播。爱尔兰是被种族清洗了！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11005.0},next={11007.0},level=55,chapter=110,drop_show={{22009,1,1,100}},coin=2060,monsterProduct=11006,populace=30,card=112008,leaderName="左权",leaderLevel=86,leaderIcon=10,leaderScore=7100,score1=8600,score2=9000,score3=4000,isBoss=0},[11007]={id=11007,camp={1.0},name="意识寄存器",desc="指挥官日志：来自心灵控制破译小组的情报：病毒宿主只有在收到命令时才会发生可辨行为体征，而在无命令时与正常人无异。现已调查出了一个信源增幅器。毁灭它爱尔兰感染者会暂时安全的——这唤起了我在雷马根大桥那不好的回忆。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={11006.0},next={11008.0},level=55,chapter=110,drop_show={{10224,1,1,2000},{22003,1,1,10000}},coin=2070,monsterProduct=11007,populace=30,card=111005,leaderName="乔瓦尼·梅塞",leaderLevel=87,leaderIcon=10,leaderScore=7210,score1=8700,score2=9000,score3=4100,Goldnum=20,isBoss=0},[11008]={id=11008,camp={1.0},name="没有灵魂",desc="指挥官日志：迫在眉睫，你我若不能在今天消灭意识寄存器（这个谐振反转录RNA的接收信息的信源），明天我们就会在海德拉的营地里傻笑呵呵——成为他们的一份子。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11007.0},next={11009.0},level=55,chapter=110,drop_show={{22007,1,1,100}},coin=2080,monsterProduct=11008,populace=30,card=111002,leaderName="伯纳德·蒙哥马利",leaderLevel=88,leaderIcon=10,leaderScore=7310,score1=8800,score2=9000,score3=4100,isBoss=1,story_target="在铁路巷战中击溃敌军（10-8）"},[11009]={id=11009,camp={1.0},name="兵家诡道",desc="指挥官日志：你可知道在遥远的东方、偏僻的内陆、隐蔽的村庄庄稼地里的抗战敌后战场里有一位天降伟人曾经说过：捣乱,失败,再捣乱。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11008.0},next={11010.0},level=55,chapter=110,drop_show={{10323,1,1,2500},{21003,1,1,10000}},coin=2090,monsterProduct=11009,populace=30,card=111005,leaderName="博克",leaderLevel=89,leaderIcon=10,leaderScore=7420,score1=8900,score2=9000,score3=4200,isBoss=0},[11010]={id=11010,camp={1.0},name="皇牌空军II",desc="指挥官日志：空军一直都是数量最少但是得以与海陆两军齐头并进的重要角色。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11009.0},next={11011.0},level=55,chapter=110,drop_show={{10324,1,1,2000},{21006,1,1,10000}},coin=2100,monsterProduct=11010,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=90,leaderIcon=10,leaderScore=7520,score1=9000,score2=9000,score3=4200,isBoss=0},[11011]={id=11011,camp={1.0},name="交叉火力",desc="指挥官日志：等等！你们不能让间谍先跑过去吗？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11010.0},next={11012.0},level=55,chapter=110,drop_show={{10123,1,1,2500},{21007,1,1,10000}},coin=2110,monsterProduct=11011,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=91,leaderIcon=10,leaderScore=7620,score1=9100,score2=9000,score3=4200,Goldnum=20,isBoss=0},[11012]={id=11012,camp={1.0},name="火力压制",desc="指挥官日志：你可想象敌方有冷冻，飞碟，尤里等最强控制压线，后方有未来坦克、V3火箭抱团范围输出是什么情景？让我派出几个美国大兵压压惊！",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11011.0},next={11101.0},level=55,chapter=110,drop_show={{10124,1,1,2000},{21010,1,1,10000}},coin=2120,monsterProduct=11012,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=92,leaderIcon=10,leaderScore=7730,score1=9200,score2=9000,score3=4200,isBoss=1,story_target="向希特勒鹰巢发起总攻(10-12)"},[11013]={id=11013,camp={1.0},name="发射井",desc="盟军简报：圣约翰到的森林地区，有着敌人的秘密发射井，而我们的目标就是集合大部队，并摧毁掉他。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11012.0},next={11014.0},level=55,chapter=110,coin=2130,monsterProduct=11013,populace=30,card=111007,leaderName="乔瓦尼·梅塞",leaderLevel=90,leaderIcon=10,leaderScore=7540,score1=9000,score2=9000,score3=4300,isBoss=0},[11014]={id=11014,camp={1.0},name="圣克鲁斯",desc="盟军简报：圣约翰岛和圣托马斯岛已经被我军掌控，实验室危机得到解除。但是剩下的敌人逃亡了圣克鲁斯岛，并打算卷土重来。我们需要去拿下他。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11013.0},next={11015.0},level=55,chapter=110,coin=2140,monsterProduct=11014,populace=30,card=111005,leaderName="乔瓦尼·梅塞",leaderLevel=90,leaderIcon=10,leaderScore=7540,score1=9000,score2=9000,score3=4300,isBoss=0},[11015]={id=11015,camp={1.0},name="克里斯琴",desc="盟军简报：整座岛屿的海岸线都建立着敌人的堡垒，我军一时之间很难找到突破口，环岛一周之后我们决定从克里斯琴打开缺口。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11014.0},next={11016.0},level=55,chapter=110,coin=2150,monsterProduct=11015,populace=30,card=111003,leaderName="艾尔温·隆美尔",leaderLevel=90,leaderIcon=10,leaderScore=7540,score1=9000,score2=9000,score3=4300,isBoss=0},[11016]={id=11016,camp={1.0},name="危机解除",desc="盟军简报：从克里斯琴打开缺口之后，敌人显然已经阻止不了我们了。摧毁敌人在这座岛的总部，夺下岛屿，彻底解除实验室的威胁。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11015.0},next={11101.0},level=55,chapter=110,coin=2160,monsterProduct=11016,populace=30,card=111004,leaderName="勃劳希契",leaderLevel=90,leaderIcon=10,leaderScore=7540,score1=9000,score2=9000,score3=4300,isBoss=0},[11101]={id=11101,camp={1.0},name="来自未来",desc="指挥官日志：可以用泥潭来形容这场反恐战争。精神控制和病毒炸掉牵制了我军地面部队的行动。又是爱因斯坦他们那支时空部队，据说这次他们要到未来战争科技工厂里去“借回”远程无人、精确制导、无限续航的完美科技。",dType=1,starRequest={3,2,1},fightType=7,dTimes=-1,vit=10,pre={11008.0},next={11102.0},level=55,chapter=111,drop_show={{10425,1,1,2000},{24005,1,1,10000}},coin=2210,dialogs={{1,11601},{1,11602},{1,11603},{1,11604},{1,11605},{1,11606},{1,11607},{1,11608}},monsterProduct=11101,populace=30,card=111010,leaderName="左权",leaderLevel=91,leaderIcon=10,leaderScore=7700,score1=9100,score2=10000,score3=4400,isBoss=0},[11102]={id=11102,camp={1.0},name="未来坦克",desc="指挥官日志：忍不住想收藏一辆未来坦克，它确实是太完美了，操作一辆天启坦克需要8个士兵，而一个死宅就能操作8辆未来坦克。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11101.0},next={11103.0},level=55,chapter=111,drop_show={{24007,1,1,100}},coin=2220,monsterProduct=11102,populace=30,card=111002,leaderName="伊塔洛·巴尔博",leaderLevel=92,leaderIcon=10,leaderScore=7810,score1=9200,score2=10000,score3=4400,isBoss=0},[11103]={id=11103,camp={1.0},name="复仇鬼王",desc="指挥官日志：有目击者称巨石阵翻起土壤爬出了巨石神兵，我是不相信这种鬼话的。但是这和截获破译的海德拉绝密通信：“底牌”。时间点吻合。我想此次工作快到头了。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11102.0},next={11104.0},level=55,chapter=111,drop_show={{10426,1,1,2000},{23003,1,1,10000}},coin=2230,monsterProduct=11103,populace=30,card=111004,leaderName="格拉齐亚尼",leaderLevel=93,leaderIcon=10,leaderScore=7920,score1=9300,score2=10000,score3=4500,Goldnum=10,isBoss=0},[11104]={id=11104,camp={1.0},name="救命闪电",desc="指挥官日志：原来爱尔兰沦陷已久，敌人挖了条海底通道，出口就在伦敦南部。不得不佩服海德拉还是很有想象力的——他们发了一封和平邮件：世界需承认英伦三岛和平统一，建立海德拉人民共和国，达此条件立即休战。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={11103.0},next={11105.0},level=55,chapter=111,drop_show={{23006,1,1,100}},coin=2240,monsterProduct=11104,populace=30,card=112006,leaderName="道格拉斯·麦克阿瑟",leaderLevel=94,leaderIcon=10,leaderScore=8040,score1=9400,score2=10000,score3=4600,isBoss=0,story_target="轰炸岛上日本防御工事（11-4）"},[11105]={id=11105,camp={1.0},name="愈演愈烈",desc="指挥官日志：用病毒感染通过洗脑成立的政府是哪门子政府。不过我们的部队首脑竟然让我们在如此不合适的地点登陆。——“征服或者毁灭”，若不能在72小时内占领，将执行冷核打击，据说是无污染的。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11104.0},next={11106.0},level=55,chapter=111,drop_show={{10225,1,1,2000},{23007,1,1,10000}},coin=2250,monsterProduct=11105,populace=30,card=112008,leaderName="博克",leaderLevel=95,leaderIcon=10,leaderScore=8140,score1=9500,score2=10000,score3=4600,isBoss=0},[11106]={id=11106,camp={1.0},name="烟飞云散",desc="指挥官日志：Pillows, but no sleep；Feathers, but no birds；Violence without purpose；I saw mommy kissing exxon mobil.在窒息压力下能够写这样日志，估计就只剩下我了吧。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11105.0},next={11107.0},level=55,chapter=111,drop_show={{22010,1,1,100}},coin=2260,monsterProduct=11106,populace=30,card=111010,leaderName="埃尔温·隆美尔",leaderLevel=96,leaderIcon=10,leaderScore=8260,score1=9600,score2=10000,score3=4700,isBoss=0},[11107]={id=11107,camp={1.0},name="终极武器",desc="指挥官日志：72小时很快过去，尽可能找到最深掩体，然后听天由命。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={11106.0},next={11108.0},level=55,chapter=111,drop_show={{10226,1,1,2000},{22001,1,1,10000}},coin=2270,monsterProduct=11107,populace=30,card=111002,leaderName="格奥尔基·朱可夫",leaderLevel=97,leaderIcon=10,leaderScore=8370,score1=9700,score2=10000,score3=4800,Goldnum=20,isBoss=0},[11108]={id=11108,camp={1.0},name="扭曲的时空",desc="指挥官日志：一阵轰鸣后，我什么都记不得了，好在日志放在身边，但这是我的吗？还有，什么是海德拉，为什么我们在这里。掩体外有交火的声音。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11107.0},next={11109.0},level=55,chapter=111,drop_show={{22008,1,1,100}},coin=2280,monsterProduct=11108,populace=30,card=111004,leaderName="德怀特·艾森豪威尔",leaderLevel=98,leaderIcon=10,leaderScore=8480,score1=9800,score2=10000,score3=4800,isBoss=1,story_target="登陆硫磺岛（11-8）"},[11109]={id=11109,camp={1.0},name="战略与战术",desc="指挥官日志：东方天降伟人曾经说过：在战略上要藐视敌人，在战术上要重视敌人！失忆之后我只记得住他的话。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11108.0},next={11110.0},level=55,chapter=111,drop_show={{10325,1,1,2000},{21009,1,1,10000}},coin=2290,monsterProduct=11109,populace=30,card=111005,leaderName="博克",leaderLevel=99,leaderIcon=10,leaderScore=8580,score1=9900,score2=10000,score3=4800,isBoss=0},[11110]={id=11110,camp={1.0},name="战场碎片",desc="指挥官日志：我必须从这些残骸中查清楚到底发生了什么。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11109.0},next={11111.0},level=55,chapter=111,drop_show={{10326,1,1,2000},{21011,1,1,10000}},coin=2300,monsterProduct=11110,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=100,leaderIcon=10,leaderScore=8690,score1=10000,score2=10000,score3=4800,isBoss=0},[11111]={id=11111,camp={1.0},name="真相",desc="指挥官日志：知道真相前我想停止这场陌生人的战争。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11110.0},next={11112.0},level=55,chapter=111,drop_show={{10125,1,1,2000},{21001,1,1,10000}},coin=2310,monsterProduct=11111,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=101,leaderIcon=10,leaderScore=8790,score1=10100,score2=10000,score3=4800,Goldnum=20,isBoss=0},[11112]={id=11112,camp={1.0},name="乱战",desc="指挥官日志：战场上谁投降就是死路一条，于是穿着同样制服的人就认做联盟。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11111.0},next={11201.0},level=55,chapter=111,drop_show={{10126,1,1,2000},{21002,1,1,10000}},coin=2320,monsterProduct=11112,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=102,leaderIcon=10,leaderScore=8900,score1=10200,score2=10000,score3=4800,isBoss=1,story_target="全歼硫磺岛日军（11-12）"},[11113]={id=11113,camp={1.0},name="查清来路",desc="盟军简报：我们需要就近建立好雷达站来侦测敌军所在，但是要注意好防护，敌人可能再次来袭。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11112.0},next={11114.0},level=55,chapter=111,coin=2330,monsterProduct=11113,populace=30,card=111004,leaderName="埃尔温·隆美尔",leaderLevel=100,leaderIcon=10,leaderScore=8710,score1=10000,score2=10000,score3=5000,isBoss=0},[11114]={id=11114,camp={1.0},name="卡德纳斯",desc="盟军简报：我们侦查到在卡德纳斯还有一个发射井，那是最后的威胁。我军选择卡德纳斯湾作为进攻突破口。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11113.0},next={11115.0},level=55,chapter=111,coin=2340,monsterProduct=11114,populace=30,card=112006,leaderName="海因茨·古德里安",leaderLevel=100,leaderIcon=10,leaderScore=8710,score1=10000,score2=10000,score3=5000,isBoss=0},[11115]={id=11115,camp={1.0},name="登岛作战",desc="盟军简报：我军舰队闪电般拿下了卡德纳斯湾。现在只要登岛去把核发射井摧毁就能完成此次战役的胜利，但岸边的敌人显然不会轻易让我们过去。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11114.0},next={11116.0},level=55,chapter=111,coin=2350,monsterProduct=11115,populace=30,card=112008,leaderName="乔治·巴顿",leaderLevel=100,leaderIcon=10,leaderScore=8710,score1=10000,score2=10000,score3=5000,isBoss=0},[11116]={id=11116,camp={1.0},name="最后的威胁",desc="盟军简报：我们已经进军到了卡德纳斯内陆，现在我们只需要摧毁该地区的核发射井就能彻底消除威胁。配合海军战舰，摧毁敌人的核发射井。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11115.0},next={11201.0},level=55,chapter=111,coin=2360,monsterProduct=11116,populace=30,card=113002,leaderName="伯纳德·蒙哥马利",leaderLevel=100,leaderIcon=10,leaderScore=8710,score1=10000,score2=10000,score3=5000,isBoss=0},[11201]={id=11201,camp={1.0},name="最后的穿越",desc="这是个艰难的决定，整个世界处于无政府无秩序的混乱当中，抢劫、暴乱，甚至清洗活动每天每处都在发生，我们队伍收集信息碎片，是时空机和质子炸弹破坏了之前时间线上的量子平衡。这是最后一次穿越，我们不会回来了。",dType=1,starRequest={3,2,1},fightType=7,dTimes=-1,vit=10,pre={11108.0},next={11202.0},level=60,chapter=112,drop_show={{10427,1,1,2000},{24002,1,1,10000}},coin=2410,dialogs={{1,11701},{1,11702}},monsterProduct=11201,populace=30,card=111011,leaderName="艾尔温·隆美尔",leaderLevel=101,leaderIcon=10,leaderScore=8870,score1=10100,score2=11000,score3=5000,isBoss=0},[11202]={id=11202,camp={1.0},name="质子危机",desc="上次的时空错乱让我失去了部分记忆，我总共穿越了3次还是4次来着？这次必须阻止盟军首脑让质子炸弹轰炸英伦三岛的决定，且不说两个谭雅让他们怎么样想，我不是复制人，但让我怎样才能相信这帮家伙不是被精神病毒给感染了？",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11201.0},next={11203.0},level=60,chapter=112,drop_show={{24003,1,1,100}},coin=2420,monsterProduct=11202,populace=30,card=111003,leaderName="格奥尔基·朱可夫",leaderLevel=102,leaderIcon=10,leaderScore=8990,score1=10200,score2=11000,score3=5100,isBoss=0},[11203]={id=11203,camp={1.0},name="惊天渡劫",desc="果真如此，原来海德拉建国只是一个幌子，目的是让总部内感染者配合动用质子武器，扭曲时空。原来我们曾经穿越到的未来科技中心——那个时间已经归海德拉所控制。现在必须先抵抗盟军内感染者的疯狂防御。",dType=1,starRequest={3,2,1},fightType=2,dTimes=-1,vit=10,pre={11202.0},next={11204.0},level=60,chapter=112,drop_show={{10428,1,1,2000},{23005,1,1,10000}},coin=2430,monsterProduct=11203,populace=30,card=112008,leaderName="海因茨·古德里安",leaderLevel=103,leaderIcon=10,leaderScore=9110,score1=10300,score2=11000,score3=5200,Goldnum=10,isBoss=0},[11204]={id=11204,camp={1.0},name="为我所用",desc="调查到控制盟军总部的信使不是已经炸毁的意识信源增幅器，而是一个移动的活靶子，尤里X终极复制体003。爱因斯坦博士提出个绝妙的计划——我们要俘获这个复制体，然后给他做开颅手术。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11203.0},next={11205.0},level=60,chapter=112,drop_show={{23004,1,1,100}},coin=2440,monsterProduct=11204,populace=30,card=113007,leaderName="海因茨·古德里安",leaderLevel=104,leaderIcon=10,leaderScore=9220,score1=10400,score2=11000,score3=5200,isBoss=0,story_target="封锁日本的港口（12-4）"},[11205]={id=11205,camp={1.0},name="收复基地",desc="中断了尤里X003的信号传播，但也来不及去总部报告情况了——我们被误会而被通缉，质子炸弹进入倒计时。唯一的办法就是用修正过的尤里X003原来的信道去控制回盟军总部。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11204.0},next={11206.0},level=60,chapter=112,drop_show={{10227,1,1,2000},{23001,1,1,10000}},coin=2450,monsterProduct=11205,populace=30,card=113003,leaderName="艾尔温·隆美尔",leaderLevel=105,leaderIcon=10,leaderScore=9340,score1=10500,score2=11000,score3=5300,isBoss=0},[11206]={id=11206,camp={1.0},name="再见了未来",desc="这座秘密的未来科技中心，由所谓的“秩序内”阶级控制，其权限似乎盟军总部只是其附属单位，它同时也是时空装置建造的中心，今晚我们喝尽最后一滴伏特加，明天太阳落山前，这个世界不再有穿越，不能去未来。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11205.0},next={11207.0},level=60,chapter=112,drop_show={{22002,1,1,100}},coin=2460,monsterProduct=11206,populace=30,card=111011,leaderName="伯纳德·蒙哥马利",leaderLevel=106,leaderIcon=10,leaderScore=9460,score1=10600,score2=11000,score3=5400,isBoss=0},[11207]={id=11207,camp={1.0},name="总攻",desc="此生我最自豪的事情就是我非常擅长理论物理和钢琴，还有我有三个甚少见面的子女。我见过咨询内的精英，比我更加博识和聪明，就像外星人，我相信他们活了几百年甚至更久，但都在一声轰隆中化作烟尘。如果说时间机器还有一个源头，那就是我。我保证爱因斯坦.埃尔伯特将永远消失——来自爱因斯坦绝笔。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11206.0},next={11208.0},level=60,chapter=112,drop_show={{10228,1,1,2000},{22006,1,1,10000}},coin=2470,monsterProduct=11207,populace=30,card=111003,leaderName="张自忠",leaderLevel=107,leaderIcon=10,leaderScore=9570,score1=10700,score2=11000,score3=5400,Goldnum=20,isBoss=0},[11208]={id=11208,camp={1.0},name="竟至末日",desc="指挥官日志：从今天到世界末日，我们永远会被记得，我们幸运的少数，我们相依相系的兄弟。谁今日与我共同浴血，他就是我的兄弟。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11207.0},next={11209.0},level=60,chapter=112,drop_show={{22004,1,1,100}},coin=2480,monsterProduct=11208,populace=30,card=112008,leaderName="乔瓦尼·梅塞",leaderLevel=108,leaderIcon=10,leaderScore=9690,score1=10800,score2=11000,score3=5500,isBoss=1,story_target="轰炸东京（12-8）"},[11209]={id=11209,camp={1.0},name="战后回忆I",desc="指挥官日志：回忆录I：一场由冷战演化而来的局部角力，在海德拉成功穿越时空秘密操作盟友总部议会的计策下剧变成了核武对决。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11208.0},next={11210.0},level=60,chapter=112,drop_show={{10327,1,1,2000},{21004,1,1,10000}},coin=2490,monsterProduct=11209,populace=30,card=111005,leaderName="博克",leaderLevel=109,leaderIcon=10,leaderScore=9800,score1=10900,score2=11000,score3=5500,isBoss=0},[11210]={id=11210,camp={1.0},name="战后回忆II",desc="指挥官日志：回忆录II：超时空行动队即使暗杀了希特勒、红骷髅也难以改变阴谋直至爱因斯坦参与做出了与未来科技组织同归于尽的了结。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11209.0},next={11211.0},level=60,chapter=112,drop_show={{10328,1,1,2000},{21005,1,1,10000}},coin=2500,monsterProduct=11210,populace=30,card=113005,leaderName="格奥尔吉·朱可夫",leaderLevel=110,leaderIcon=10,leaderScore=9910,score1=11000,score2=11000,score3=5500,isBoss=0},[11211]={id=11211,camp={1.0},name="和平军演I",desc="指挥官日志：战后苏联同盟国大多选择了永恒秩序科技，也在东方诞生了几个天降伟人政权，日本亦被收刮于其囊内成为傀儡。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11210.0},next={11212.0},level=60,chapter=112,drop_show={{10127,1,1,2000},{21008,1,1,10000}},coin=2510,monsterProduct=11211,populace=30,card=112005,leaderName="乔治·巴顿",leaderLevel=111,leaderIcon=10,leaderScore=10020,score1=11100,score2=11000,score3=5500,Goldnum=20,isBoss=0},[11212]={id=11212,camp={1.0},name="和平军演II",desc="指挥官日志：美国东西岸分裂多个资本繁荣政策独立政府，欧洲不得以联合抵御永恒秩序的压力。而海德拉和“秩序内议会”则消失与黑暗之中。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11211.0},level=60,chapter=112,drop_show={{10128,1,1,2000}},coin=2520,monsterProduct=11212,populace=30,card=112002,leaderName="伯纳德·蒙哥马利",leaderLevel=112,leaderIcon=10,leaderScore=10130,score1=11200,score2=11000,score3=5500,isBoss=1,story_target="向广岛投掷核弹（12-12）"},[11213]={id=11213,camp={1.0},name="绝粮之战",desc="盟军简报：我们已经对莫斯科地区完成了绝对的掌控。不过困兽之斗会让我们付出巨大的代价，所以我军决定围困他们。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11212.0},next={11214.0},level=60,chapter=112,coin=2530,monsterProduct=11213,populace=30,card=112008,leaderName="埃尔温·隆美尔",leaderLevel=110,leaderIcon=10,leaderScore=9920,score1=11000,score2=11000,score3=5600},[11214]={id=11214,camp={1.0},name="围点打援",desc="盟军简报：莫斯科苏军已经无力翻盘，为了更多的消灭苏军有生力量，我军决定以这个地区作为诱饵，狙击前来增援的部队。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11213.0},next={11215.0},level=60,chapter=112,coin=2540,monsterProduct=11214,populace=30,card=113007,leaderName="小乔治·巴顿",leaderLevel=110,leaderIcon=10,leaderScore=9920,score1=11000,score2=11000,score3=5600},[11215]={id=11215,camp={1.0},name="红场之战",desc="盟军简报：敌人进行最后的反扑，进攻到了红场之上，这是他们最后的力量了，士兵们，为了最后的胜利，击溃他们。",dType=1,starRequest={3,2,1},fightType=3,dTimes=-1,vit=10,pre={11214.0},next={11216.0},level=60,chapter=112,coin=2550,monsterProduct=11215,populace=30,card=113003,leaderName="艾尔温·隆美尔",leaderLevel=110,leaderIcon=10,leaderScore=9920,score1=11000,score2=