evel=3,leaderIcon=8,leaderScore=110,score1=300,score2=1000,score3=0,Goldnum=30,isBoss=0,elite_refresh_time=15},[20301]={id=20301,camp={1.0},name="圣西尔军校I",desc="指挥官日志：圣西尔军校三年的生涯是我学习军事基础理论的时光。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20202, 10312},next={20302.0},level=1,chapter=203,drop_show={{10825,5,5,10000},{49098,1,1,600}},coin=250,heroExp=0,monsterProduct=20301,populace=30,card=112005,leaderName="切斯特·尼米兹",leaderLevel=2,leaderIcon=1,leaderScore=80,score1=200,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20302]={id=20302,camp={1.0},name="圣西尔军校II",desc="指挥官日志：可惜战场上军校顶个屁，军校就是政治裙带的过继，那些贵族同窗总在前线的最后方，在庆功的最前方。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20301.0},next={20303.0},level=1,chapter=203,drop_show={{10824,5,5,10000},{49098,1,1,600}},coin=260,heroExp=0,monsterProduct=20302,populace=30,card=113003,leaderName="埃尔温·隆美尔",leaderLevel=3,leaderIcon=2,leaderScore=110,score1=300,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20303]={id=20303,camp={1.0},name="遭遇伏击",desc="指挥官日志：是谁在树林里放冷枪？提心吊胆的行军刹那间变身修罗地狱。这只部队损失了一半人马。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20302.0},next={20304.0},level=1,chapter=203,drop_show={{10826,5,5,10000},{49098,1,1,600}},coin=270,heroExp=0,monsterProduct=20303,populace=30,card=113005,leaderName="勃洛姆堡",leaderLevel=3,leaderIcon=3,leaderScore=110,score1=300,score2=1000,score3=0,Goldnum=30,isBoss=0,elite_refresh_time=15},[20304]={id=20304,camp={1.0},name="铁盾增援",desc="指挥官日志：我方的空军完全侦测不到高度伪装的敌军坦克，坦克！我们需要碾压过去迫他们现形。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20303},next={20401.0},level=1,chapter=203,drop_show={{10821,5,5,10000},{49098,1,1,600}},coin=280,heroExp=0,monsterProduct=20304,populace=30,card=114001,leaderName="埃尔温·隆美尔",leaderLevel=3,leaderIcon=4,leaderScore=110,score1=300,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20401]={id=20401,camp={1.0},name="幕后黑手",desc="指挥官日志：冷战开始了，没有硝烟，疯狂的军备竞赛在美苏两大阵营间展开。相信我，作为一个军人，我从未见过那样的武器，但我还来不及感叹军队科学家的疯狂，一份绝密情报，让我发现这背后的不妥。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20304, 10412},next={20402.0},level=5,chapter=204,drop_show={{10812,5,5,10000},{49098,1,1,600}},coin=410,heroExp=0,monsterProduct=20401,populace=30,card=111009,leaderName="左权",leaderLevel=6,leaderIcon=5,leaderScore=200,score1=600,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20402]={id=20402,camp={1.0},name="纳粹残余",desc="指挥官日志：现在有理由相信纳粹忠诚的党卫军军团贼心不死在密谋着什么，可恨的是盟军、苏军竟然都与纳粹残党进行战争科技交易，现在我大概明白了那些黑科技的来源了。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20401.0},next={20403.0},level=5,chapter=204,drop_show={{10817,5,5,10000},{49098,1,1,600}},coin=420,heroExp=0,monsterProduct=20402,populace=30,card=112009,leaderName="艾尔温·隆美尔",leaderLevel=6,leaderIcon=6,leaderScore=200,score1=600,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20403]={id=20403,camp={1.0},name="天启坦克",desc="指挥官日志：海德拉是什么鬼？截获的情报显示这个组织绝非党卫军那样单纯。战争永未结束，至少于我是的，盟军指挥部让我带着这只战后残破不堪的装甲突击旅，去调查情报中海德拉藏身地点——波兰南部瓦乌布日赫山区。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20402.0},next={20404.0},level=5,chapter=204,drop_show={{10813,5,5,10000},{49098,1,1,600}},coin=430,monsterProduct=20403,populace=30,card=113004,leaderName="左权",leaderLevel=7,leaderIcon=8,leaderScore=230,score1=700,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20404]={id=20404,camp={1.0},name="无名战火",desc="指挥官日志：一早便预料到了这场袭击，多亏了总部调来两架冷冻直升机支援，损失得以降到最小。该死的威力巨大的怪物——它应该叫做“天启”？另我感到不安的是：在苏占区边线发生了多起小规模冲突，终于联盟和苏军要打起来了？难道他们还没打够？",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20403.0},next={20501.0},level=5,chapter=204,drop_show={{10806,5,5,10000},{49098,1,1,600}},coin=440,monsterProduct=20404,populace=30,card=111003,leaderName="克卢格",leaderLevel=7,leaderIcon=8,leaderScore=230,score1=700,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20501]={id=20501,camp={1.0},name="孤军深入",desc="指挥官日志：若联盟和苏军正式开战的话，后果不堪设想，上级驳回了我的增援报告，看来已无暇关照我们了。我真心希望对海德拉的调查能够找到缓解矛盾的线索，毕竟这两头卖科技卖情报的该死的掮客，能够是什么好东西？",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20404, 10512},next={20502.0},level=5,chapter=205,drop_show={{10800,5,5,10000},{49098,1,1,600}},coin=450,monsterProduct=20501,populace=30,card=111005,leaderName="乔治·巴顿",leaderLevel=8,leaderIcon=9,leaderScore=270,score1=800,score2=1000,score3=0,Goldnum=30,isBoss=0,elite_refresh_time=15},[20502]={id=20502,camp={1.0},name="莫名的命令",desc="指挥官日志：撤退？我带领一干兄弟孤军深入，埋骨他乡，连海德拉的眉毛都没摸到就让我撤退？战争的皮条客还有保护伞吗？",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20501.0},next={20503.0},level=5,chapter=205,drop_show={{10830,5,5,10000},{49098,1,1,600}},coin=460,monsterProduct=20502,populace=30,card=112001,leaderName="格拉齐亚尼",leaderLevel=8,leaderIcon=10,leaderScore=270,score1=800,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20503]={id=20503,camp={1.0},name="九头蛇组织",desc="指挥官日志：最后一晚，这是我们最接近海德拉秘密基地的一晚，天亮就按该死的命令撤退。时间不多了，今晚总得查出点什么来。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20502.0},next={20504.0},level=5,chapter=205,drop_show={{10829,5,5,10000},{49098,1,1,600}},coin=470,monsterProduct=20503,talk={{0,"哈哈哈，我的飞碟能让接近它们的机械单位失灵，变成废物",1,4}},hero_show=61004,populace=30,card=112003,leaderName="奥马尔·布莱德雷",leaderLevel=9,leaderIcon=10,leaderScore=310,score1=900,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20504]={id=20504,camp={1.0},name="九头蛇首领",desc="指挥官日志：猛烈的袭击，部队已所剩无几，但敌人目标已暴露，九头蛇的秘密基地已在眼前。如果有人让我此刻撤退，那下命令的人一定是在叛国！这次袭击将是我人生最大的一次冒险，但比起爆发世界大战，这又算得了什么呢？",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20503.0},next={20601.0},level=5,chapter=205,drop_show={{10825,5,5,10000},{49098,1,1,600}},coin=480,monsterProduct=20504,populace=30,card=111009,leaderName="奥马尔·布莱德雷",leaderLevel=9,leaderIcon=10,leaderScore=310,score1=900,score2=1000,score3=0,isBoss=1,elite_refresh_time=15},[20601]={id=20601,camp={1.0},name="桑赫斯特军校I",desc="指挥官日志：或者我不疲于到处去说理论军事和号召演讲的圣西尔投机分子戴高乐的故事，但是你知道桑赫斯特酒鬼种马丘吉尔可是和他臭味相投。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20504, 10612},next={20602.0},level=5,chapter=206,drop_show={{10824,5,5,10000},{49098,1,1,600}},coin=450,monsterProduct=20601,populace=30,card=111005,leaderName="乔治·巴顿",leaderLevel=8,leaderIcon=10,leaderScore=270,score1=800,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20602]={id=20602,camp={1.0},name="桑赫斯特军校II",desc="指挥官日志：桑赫斯特，战争投机者的发达梦。多数人只是陪葬品，总有人在关键时刻倒打一耙。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20601.0},next={20603.0},level=5,chapter=206,drop_show={{10826,5,5,10000},{49098,1,1,600}},coin=460,monsterProduct=20602,populace=30,card=112001,leaderName="格拉齐亚尼",leaderLevel=8,leaderIcon=10,leaderScore=270,score1=800,score2=1000,score3=0,Goldnum=30,isBoss=0,elite_refresh_time=15},[20603]={id=20603,camp={1.0},name="坦克战线",desc="指挥官日志：最后一晚，这是我们最接近海德拉秘密基地的一晚，天亮就按该死的命令撤退。时间不多了，今晚总得查出点什么来。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20602.0},next={20604.0},level=5,chapter=206,drop_show={{10821,5,5,10000},{49098,1,1,600}},coin=470,monsterProduct=20603,populace=30,card=112003,leaderName="奥马尔·布莱德雷",leaderLevel=9,leaderIcon=10,leaderScore=310,score1=900,score2=1000,score3=0,isBoss=0,elite_refresh_time=15},[20604]={id=20604,camp={1.0},name="大兵搅拌机",desc="指挥官日志：猛烈的袭击，部队已所剩无几，但敌人目标已暴露，九头蛇的秘密基地已在眼前。如果有人让我此刻撤退，那下命令的人一定是在叛国！这次袭击将是我人生最大的一次冒险，但比起爆发世界大战，这又算得了什么呢？",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20603.0},next={20701.0},level=5,chapter=206,drop_show={{10812,5,5,10000},{49098,1,1,600}},coin=480,monsterProduct=20604,populace=30,card=111009,leaderName="奥马尔·布莱德雷",leaderLevel=9,leaderIcon=10,leaderScore=310,score1=900,score2=1000,score3=0,isBoss=1,elite_refresh_time=15},[20701]={id=20701,camp={1.0},name="坦克杀手",desc="指挥官日志：一个月！九头蛇首领,噢，不，应该还是纳粹的新领袖狂傲的挑战就换来美苏间一个月的纸上和平？！更多的证据！海德拉，我会追杀你到天涯海角！",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20604, 10712},next={20702.0},level=10,chapter=207,drop_show={{10825,5,5,10000},{49098,1,1,600}},coin=610,monsterProduct=20701,populace=30,card=111008,leaderName="伯纳德·蒙哥马利",leaderLevel=11,leaderIcon=10,leaderScore=450,score1=1100,score2=2000,score3=0,isBoss=0,elite_refresh_time=15},[20702]={id=20702,camp={1.0},name="遥远的桥",desc="指挥官日志：克莱斯勒公司二千万战争债券提供的战车工厂总算是保下来了，接下来该派这些新机器去干活了。乱上加乱——纳粹复燃了，居然竟然还有少部分盟军叛军，短时间搞不明白是怎么一回事。他们占据了莱茵河对面雷马根区块，“攻下那座桥”，指挥部的命令只有这五个字。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20701.0},next={20703.0},level=10,chapter=207,drop_show={{10824,5,5,10000},{49098,1,1,600}},coin=620,monsterProduct=20702,populace=30,card=112007,leaderName="奥马尔·布莱德雷",leaderLevel=12,leaderIcon=10,leaderScore=490,score1=1200,score2=2000,score3=0,isBoss=0,elite_refresh_time=15},[20703]={id=20703,camp={1.0},name="武装直升机I",desc="指挥官日志：战斗很激烈，但战领者是我们，再攻过去，叛乱区就要被平定了。很难相信有那么多平民陪葬——当他们着魔似的手里拿着铁器利器朝你涌来，根本没有选择余地。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20702.0},next={20704.0},level=10,chapter=207,drop_show={{10826,5,5,10000},{49098,1,1,600}},coin=630,monsterProduct=20703,populace=30,card=114001,leaderName="伯纳德·蒙哥马利",leaderLevel=13,leaderIcon=10,leaderScore=540,score1=1300,score2=2000,score3=0,isBoss=0,elite_refresh_time=15},[20704]={id=20704,camp={1.0},name="命令与将军",desc="指挥官日志：敌人哪来数量如此多的武装直升机？躲进战壕！然后？坚守阵地。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20703.0},next={20801.0},level=10,chapter=207,drop_show={{10821,5,5,10000},{49098,1,1,600}},coin=640,monsterProduct=20704,populace=30,card=112001,leaderName="格拉齐亚尼",leaderLevel=14,leaderIcon=10,leaderScore=590,score1=1400,score2=2000,score3=0,isBoss=0,elite_refresh_time=15},[20801]={id=20801,camp={1.0},name="入侵者战机I",desc="指挥官日志：入侵者战机，那是苏军的装备，是苏军利用九头蛇打击我们，还是苏军被九头蛇控制利用，我不得而知。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20704, 10812},next={20802.0},level=10,chapter=208,drop_show={{10812,5,5,10000},{49098,1,1,600}},coin=650,monsterProduct=20801,populace=30,card=111003,leaderName="乔瓦尼·梅塞",leaderLevel=15,leaderIcon=10,leaderScore=640,score1=1500,score2=2000,score3=0,Goldnum=10,isBoss=0,elite_refresh_time=15},[20802]={id=20802,camp={1.0},name="矛与盾",desc="指挥官日志：天呐，当我看到这些天启坦克的时候，我已绝望地在做最后祷告，岂知道天无绝人之路，这些天启坦克却是苏军派来支援我们的——一起恍然大悟，苏军盟军再次联合起来，九头蛇胆敢犯众，看来死期不远了。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20801.0},next={20803.0},level=10,chapter=208,drop_show={{10817,5,5,10000},{49098,1,1,600}},coin=660,monsterProduct=20802,populace=30,card=111005,leaderName="奥马尔·布莱德雷",leaderLevel=16,leaderIcon=10,leaderScore=690,score1=1600,score2=2000,score3=0,isBoss=0,elite_refresh_time=15},[20803]={id=20803,camp={1.0},name="203高地",desc="指挥官日志：九头蛇突然停止了接连不断的空袭，战壕里士兵都快发疯了，黄昏时有个年轻的小伙违抗命令爬出战壕，不幸的是冷枪夺走他的生命。他为何爬出去，没有人知道为什么。可是，今天的前线战报我还能怎么写呢？——西线无战事。仅此。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20802.0},next={20804.0},level=10,chapter=208,drop_show={{10813,5,5,10000},{49098,1,1,600}},coin=670,monsterProduct=20803,populace=30,card=113005,leaderName="德怀特·艾森豪威尔",leaderLevel=17,leaderIcon=10,leaderScore=740,score1=1700,score2=2000,score3=0,isBoss=0,elite_refresh_time=15},[20804]={id=20804,camp={1.0},name="拯救大兵",desc="指挥官日志：我一个情同手足的部下——温特斯少校，被敌人围困。大局上，自顾不暇，应该放弃这只连队，但是这次我还是偏私了。温斯特不能就这样死去。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20803.0},next={20901.0},level=10,chapter=208,drop_show={{10806,5,5,10000},{49098,1,1,600}},coin=680,monsterProduct=20804,populace=30,card=111008,leaderName="乔治·巴顿",leaderLevel=18,leaderIcon=10,leaderScore=790,score1=1800,score2=2000,score3=0,isBoss=1,elite_refresh_time=15},[20901]={id=20901,camp={1.0},name="伏龙芝军校I",desc="指挥官日志：那是不同的光景在伏龙芝军校——你很少见到在军校里会因派系斗争而经常有小规模灭口事件发生。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20804, 10912},next={20902.0},level=10,chapter=209,drop_show={{10806,5,5,10000},{49098,1,1,600}},coin=690,monsterProduct=20901,populace=30,card=112007,leaderName="勃劳希契",leaderLevel=19,leaderIcon=10,leaderScore=840,score1=1900,score2=2000,score3=0,isBoss=0,elite_refresh_time=15},[20902]={id=20902,camp={1.0},name="伏龙芝军校II",desc="指挥官日志：伏龙芝军校有一种红色恐怖的压抑。",dType=1,starRequest={21,20,19},fightType=3,dTimes=3,vit=10,pre={20901.0},next={20903.0},level=10,chapter=209,drop_show={{